		<div>
			<p style="margin-top:2.9pt; margin-bottom:0pt; font-size:60pt">
				<span style="font-family:'Times New Roman'">&#xa0;</span>
			</p>
			<p style="margin-top:0pt; margin-right:15.3pt; margin-bottom:0pt; text-align:center; font-size:60pt">
				<span style="color:#ff0000">SQL</span><span style="letter-spacing:-0.1pt; color:#ff0000"> Basics</span>
			</p>
			
			
		</div>
		
		<div>
			<h2 style="margin-top:0pt; margin-left:31.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal">What</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.95pt"> </span><span style="font-size:40pt; font-weight:normal">is</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.8pt"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.2pt">SQL?</span>
			</h2>
			<p style="margin:11.75pt 43.65pt 0pt 43.75pt; text-indent:-36.15pt; line-height:88%; font-size:30pt">
				<span style="font-family:Arial">•</span><span style="width:25.65pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>SQL stands for <span style="color:#ff0000">Structured Query Language</span>. It is used<span style="letter-spacing:-0.85pt"> </span>for<span style="letter-spacing:-0.8pt"> </span>storing<span style="letter-spacing:-0.7pt"> </span>and<span style="letter-spacing:-0.85pt"> </span>managing<span style="letter-spacing:-0.8pt"> </span>data<span style="letter-spacing:-0.9pt"> </span>in<span style="letter-spacing:-0.35pt"> </span>Relational Database Management System (RDBMS).
			</p>
			<p style="margin:7.7pt 41.25pt 0pt 43.75pt; text-indent:-36.15pt; text-align:justify; line-height:88%; font-size:30pt">
				<span style="font-family:Arial">•</span><span style="width:25.65pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>It<span style="letter-spacing:-0.2pt"> </span>is a<span style="letter-spacing:-0.05pt"> </span>standard<span style="letter-spacing:-0.1pt"> </span>language<span style="letter-spacing:-0.1pt"> </span>for<span style="letter-spacing:-0.05pt"> </span>Relational<span style="letter-spacing:-0.1pt"> </span>Database System.<span style="letter-spacing:-0.9pt"> </span>It<span style="letter-spacing:-0.9pt"> </span>enables<span style="letter-spacing:-0.75pt"> </span>a<span style="letter-spacing:-0.85pt"> </span>user<span style="letter-spacing:-0.75pt"> </span>to<span style="letter-spacing:-0.65pt"> </span><strong><span style="color:#00afef">create,</span></strong><strong><span style="letter-spacing:-0.95pt; color:#00afef"> </span></strong><strong><span style="color:#00afef">read,</span></strong><strong><span style="letter-spacing:-0.8pt; color:#00afef"> </span></strong><strong><span style="color:#00afef">update and delete </span></strong>relational databases and tables.
			</p>
			<p style="margin:7.75pt 40.8pt 0pt 43.75pt; text-indent:-36.15pt; text-align:justify; line-height:88%; font-size:30pt">
				<span style="font-family:Arial">•</span><span style="width:25.65pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>All<span style="letter-spacing:-0.3pt"> </span>the<span style="letter-spacing:-0.45pt"> </span>RDBMS<span style="letter-spacing:-0.3pt"> </span>like<span style="letter-spacing:-0.15pt"> </span><strong><span style="color:#bf0000">MySQL,</span></strong><strong><span style="letter-spacing:-0.35pt; color:#bf0000"> </span></strong><strong><span style="color:#bf0000">Informix,</span></strong><strong><span style="letter-spacing:-0.25pt; color:#bf0000"> </span></strong><strong><span style="color:#bf0000">Oracle,</span></strong><strong><span style="letter-spacing:-0.45pt; color:#bf0000"> </span></strong><strong><span style="color:#bf0000">MS Access</span></strong><strong><span style="letter-spacing:-0.7pt; color:#bf0000"> </span></strong><strong><span style="color:#bf0000">and</span></strong><strong><span style="letter-spacing:-0.45pt; color:#bf0000"> </span></strong><strong><span style="color:#bf0000">SQL</span></strong><strong><span style="letter-spacing:-0.6pt; color:#bf0000"> </span></strong><strong><span style="color:#bf0000">Server</span></strong><strong><span style="letter-spacing:-0.3pt; color:#bf0000"> </span></strong>use<span style="letter-spacing:-0.5pt"> </span>SQL<span style="letter-spacing:-0.55pt"> </span>as<span style="letter-spacing:-0.6pt"> </span>their<span style="letter-spacing:-0.45pt"> </span>standard database language.
			</p>
			<p style="margin:7.7pt 64.3pt 0pt 43.75pt; text-indent:-36.15pt; text-align:justify; line-height:88%; font-size:30pt">
				<span style="font-family:Arial">•</span><span style="width:25.65pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>SQL allows users to query the database in a number<span style="letter-spacing:-1.25pt"> </span>of<span style="letter-spacing:-1.2pt"> </span>ways,<span style="letter-spacing:-1.2pt"> </span>using<span style="letter-spacing:-1.15pt"> </span>English-like<span style="letter-spacing:-1.25pt"> </span>statements.
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="height:0pt; display:block; position:absolute; z-index:-26"><img src="data:image/png;base64," width="960" height="360" alt="" style="margin-top:240pt; margin-left:-37.15pt; position:absolute" ></span><span style="font-size:40pt; font-weight:normal">What</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.15pt"> </span><span style="font-size:40pt; font-weight:normal">are</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.15pt"> </span><span style="font-size:40pt; font-weight:normal">the</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.15pt"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.2pt">SQL?</span>
			</h2>
			<h3 style="margin-top:11.95pt; margin-left:7.15pt; margin-bottom:0pt; font-size:32pt">
				<span style="font-weight:normal">SQL</span><span style="font-weight:normal; letter-spacing:-0.95pt"> </span><span style="font-weight:normal">follows</span><span style="font-weight:normal; letter-spacing:-0.7pt"> </span><span style="font-weight:normal">the</span><span style="font-weight:normal; letter-spacing:-0.6pt"> </span><span style="font-weight:normal">following</span><span style="font-weight:normal; letter-spacing:-0.45pt"> </span><span style="font-weight:normal; letter-spacing:-0.1pt">rules:</span>
			</h3>
			<p style="margin:6.15pt 38.1pt 0pt 39.1pt; text-indent:-31.95pt; line-height:98%; font-size:26pt">
				<span style="font-family:Arial">•</span><span style="width:22.85pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Structure<span style="letter-spacing:-1.05pt"> </span>query<span style="letter-spacing:-0.95pt"> </span>language<span style="letter-spacing:-0.85pt"> </span>is<span style="letter-spacing:-0.7pt"> </span>not<span style="letter-spacing:-0.7pt"> </span>case<span style="letter-spacing:-0.9pt"> </span>sensitive.<span style="letter-spacing:-1pt"> </span>Generally, keywords of SQL are written in uppercase.
			</p>
			<p style="margin:23.7pt 54.85pt 0pt 39.1pt; text-indent:-31.95pt; line-height:98%; font-size:26pt">
				<span style="font-family:Arial">•</span><span style="width:22.85pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Statements<span style="letter-spacing:-0.75pt"> </span>of<span style="letter-spacing:-0.3pt"> </span>SQL<span style="letter-spacing:-0.5pt"> </span>are<span style="letter-spacing:-0.4pt"> </span>dependent<span style="letter-spacing:-0.8pt"> </span>on<span style="letter-spacing:-0.4pt"> </span>text<span style="letter-spacing:-0.6pt"> </span>lines.<span style="letter-spacing:-0.6pt"> </span>We<span style="letter-spacing:-0.5pt"> </span>can use<span style="letter-spacing:-0.7pt"> </span>a<span style="letter-spacing:-0.35pt"> </span>single<span style="letter-spacing:-0.45pt"> </span>SQL<span style="letter-spacing:-0.45pt"> </span>statement<span style="letter-spacing:-0.7pt"> </span>on<span style="letter-spacing:-0.35pt"> </span>one<span style="letter-spacing:-0.45pt"> </span>or<span style="letter-spacing:-0.25pt"> </span>multiple<span style="letter-spacing:-0.55pt"> </span>text<span style="letter-spacing:-0.05pt"> </span>line.
			</p>
			<p style="margin:26.6pt 52.4pt 0pt 39.1pt; text-indent:-31.95pt; line-height:98%; font-size:26pt">
				<span style="font-family:Arial">•</span><span style="width:22.85pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Using<span style="letter-spacing:-0.75pt"> </span>the<span style="letter-spacing:-0.6pt"> </span>SQL<span style="letter-spacing:-0.5pt"> </span>statements,<span style="letter-spacing:-0.95pt"> </span>you<span style="letter-spacing:-0.4pt"> </span>can<span style="letter-spacing:-0.6pt"> </span>perform<span style="letter-spacing:-0.5pt"> </span>most<span style="letter-spacing:-0.55pt"> </span>of<span style="letter-spacing:-0.5pt"> </span>the actions in a database.
			</p>
			<p style="margin:29.45pt 57.65pt 0pt 39.1pt; text-indent:-31.95pt; line-height:98%; font-size:26pt">
				<span style="font-family:Arial">•</span><span style="width:22.85pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>SQL<span style="letter-spacing:-0.6pt"> </span>depends<span style="letter-spacing:-0.75pt"> </span>on<span style="letter-spacing:-0.4pt"> </span>tuple<span style="letter-spacing:-0.5pt"> </span>relational<span style="letter-spacing:-0.45pt"> </span>calculus<span style="letter-spacing:-0.6pt"> </span>and<span style="letter-spacing:-0.5pt"> </span>relational <span style="letter-spacing:-0.1pt">algebra.</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="height:0pt; display:block; position:absolute; z-index:-25"><img src="data:image/png;base64," width="960" height="360" alt="" style="margin-top:240pt; margin-left:-37.15pt; position:absolute" ></span><span style="font-size:40pt; font-weight:normal; color:#ff0000">What</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.9pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">is</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.8pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">SQL</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.75pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">Process?</span>
			</h2>
			<p style="margin:12.45pt 33.95pt 0pt 39.1pt; text-indent:-31.95pt; text-align:justify; line-height:98%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:22.05pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>When an SQL command is executing for any RDBMS, then the system figure out the best way to carry out the<span style="letter-spacing:-0.6pt"> </span>request<span style="letter-spacing:-0.4pt"> </span>and<span style="letter-spacing:-0.4pt"> </span>the<span style="letter-spacing:-0.5pt"> </span>SQL<span style="letter-spacing:-0.6pt"> </span>engine<span style="letter-spacing:-0.5pt"> </span>determines<span style="letter-spacing:-0.4pt"> </span>that<span style="letter-spacing:-0.65pt"> </span>how to interpret the task.
			</p>
			<p style="margin:26.3pt 24.65pt 0pt 39.1pt; text-indent:-31.95pt; line-height:98%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:22.15pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>In the process, various components are included. These<span style="letter-spacing:-0.9pt"> </span>components<span style="letter-spacing:-0.4pt"> </span>can<span style="letter-spacing:-0.75pt"> </span>be<span style="letter-spacing:-0.8pt"> </span>optimization<span style="letter-spacing:-0.6pt"> </span>Engine,<span style="letter-spacing:-0.7pt"> </span>Query engine, Query dispatcher, classic, etc.
			</p>
			<p style="margin:28.65pt 71.25pt 0pt 39.1pt; text-indent:-31.95pt; text-align:justify; line-height:98%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:22.05pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>All<span style="letter-spacing:-0.55pt"> </span>the<span style="letter-spacing:-0.35pt"> </span>non-SQL<span style="letter-spacing:-0.15pt"> </span>queries<span style="letter-spacing:-0.25pt"> </span>are<span style="letter-spacing:-0.55pt"> </span>handled<span style="letter-spacing:-0.2pt"> </span>by<span style="letter-spacing:-0.3pt"> </span>the<span style="letter-spacing:-0.45pt"> </span>classic query engine, but SQL query engine won't<span style="letter-spacing:-0.05pt"> </span>handle logical files.
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal">What</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.9pt"> </span><span style="font-size:40pt; font-weight:normal">is</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.8pt"> </span><span style="font-size:40pt; font-weight:normal">SQL</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.75pt"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt">Process?</span>
			</h2>
			<p style="margin-top:1.4pt; margin-bottom:0pt; font-size:10pt">
				<img src="data:image/png;base64," width="852" height="542" alt="" ><br >
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<p style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="height:0pt; display:block; position:absolute; z-index:-24"><img src="data:image/png;base64," width="960" height="360" alt="" style="margin-top:240pt; margin-left:-37.15pt; position:absolute" ></span><span style="font-size:40pt">What</span><span style="font-size:40pt; letter-spacing:-1.6pt"> </span><span style="font-size:40pt">is</span><span style="font-size:40pt; letter-spacing:-1.55pt"> </span><span style="font-size:40pt">Advantages</span><span style="font-size:40pt; letter-spacing:-1.55pt"> </span><span style="font-size:40pt">of</span><span style="font-size:40pt; letter-spacing:-1.35pt"> </span><span style="font-size:40pt; letter-spacing:-0.2pt">SQL?</span>
			</p>
			<p style="margin-top:11.9pt; margin-left:39.1pt; margin-bottom:0pt; text-indent:-31.95pt; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:22.15pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>High<span style="letter-spacing:-0.75pt"> </span><span style="letter-spacing:-0.1pt">speed</span>
			</p>
			<p style="margin-top:6.15pt; margin-left:39.1pt; margin-bottom:0pt; text-indent:-31.95pt; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:22.15pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>No<span style="letter-spacing:-0.8pt"> </span>coding<span style="letter-spacing:-0.6pt"> </span><span style="letter-spacing:-0.1pt">needed</span>
			</p>
			<p style="margin-top:6.15pt; margin-left:39.1pt; margin-bottom:0pt; text-indent:-31.95pt; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:22.15pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Well<span style="letter-spacing:-1.6pt"> </span>defined<span style="letter-spacing:-1.55pt"> </span><span style="letter-spacing:-0.1pt">standards</span>
			</p>
			<p style="margin-top:6.1pt; margin-left:39.1pt; margin-bottom:0pt; text-indent:-31.95pt; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:22.15pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="letter-spacing:-0.1pt">Portability</span>
			</p>
			<p style="margin-top:6.15pt; margin-left:39.1pt; margin-bottom:0pt; text-indent:-31.95pt; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:22.15pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="letter-spacing:-0.2pt">Interactive</span><span style="letter-spacing:-1.05pt"> </span><span style="letter-spacing:-0.1pt">language</span>
			</p>
			<p style="margin-top:6.15pt; margin-left:39.1pt; margin-bottom:0pt; text-indent:-31.95pt; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:22.15pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Multiple<span style="letter-spacing:-1.15pt"> </span>data<span style="letter-spacing:-1.3pt"> </span><span style="letter-spacing:-0.2pt">view</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal">What</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.9pt"> </span><span style="font-size:40pt; font-weight:normal">is</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.85pt"> </span><span style="font-size:40pt; font-weight:normal">SQL</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.7pt"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt">Datatype?</span>
			</h2>
			<p style="margin:12.45pt 72.6pt 0pt 61.4pt; text-indent:-54.25pt; line-height:98%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:44.45pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>SQL<span style="letter-spacing:-0.5pt"> </span>Datatype<span style="letter-spacing:-0.6pt"> </span>is<span style="letter-spacing:-0.45pt"> </span>used<span style="letter-spacing:-0.35pt"> </span>to<span style="letter-spacing:-0.55pt"> </span>define<span style="letter-spacing:-0.45pt"> </span>the<span style="letter-spacing:-0.45pt"> </span>values<span style="letter-spacing:-0.45pt"> </span>that<span style="letter-spacing:-0.45pt"> </span>a column can contain.
			</p>
			<p style="margin:6.9pt 46.95pt 0pt 61.4pt; text-indent:-54.25pt; line-height:98%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:44.45pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Every<span style="letter-spacing:-0.9pt"> </span>column<span style="letter-spacing:-0.45pt"> </span>is<span style="letter-spacing:-0.6pt"> </span>required<span style="letter-spacing:-0.5pt"> </span>to<span style="letter-spacing:-0.7pt"> </span>have<span style="letter-spacing:-0.7pt"> </span>a<span style="letter-spacing:-0.7pt"> </span>name<span style="letter-spacing:-0.6pt"> </span>and<span style="letter-spacing:-0.65pt"> </span>data type in the database table.
			</p>
			<p style="margin-top:0pt; margin-left:30pt; margin-bottom:0pt; font-size:10pt">
				<img src="data:image/png;base64," width="815" height="351" alt="" >
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal">SQL</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.8pt"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt">Commands</span>
			</h2>
			<p style="margin:12.45pt 16.1pt 0pt 43.75pt; text-indent:-36.6pt; text-align:justify; line-height:98%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:26.8pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>SQL commands are instructions. It is used to communicate with the database. It is also used to perform <span style="color:#ff0000">specific tasks, functions, and queries of data</span>.
			</p>
			<p style="margin-top:13.15pt; margin-bottom:0pt; font-size:28pt">
				&#xa0;
			</p>
			<p style="margin:0pt 16.25pt 0pt 43.75pt; text-indent:-36.6pt; text-align:justify; line-height:98%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:26.8pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>SQL can perform various tasks like <span style="color:#ff0000">create a table, add data to tables, drop the table, modify the table, set permission for users.</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.15pt">
				<span style="font-size:40pt; font-weight:normal">Types</span><span style="font-size:40pt; font-weight:normal; letter-spacing:2.3pt"> </span><span style="font-size:40pt; font-weight:normal">of</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1pt"> </span><span style="font-size:40pt; font-weight:normal">SQL</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.95pt"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt">Commands</span>
			</h2>
			<p style="margin:0.5pt 16.35pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:26.8pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><img src="data:image/png;base64," width="775" height="464" alt="" ><br >There<span style="letter-spacing:4pt"> </span>are<span style="letter-spacing:4pt"> </span>five<span style="letter-spacing:4pt"> </span>types<span style="letter-spacing:4pt"> </span>of<span style="letter-spacing:4pt"> </span>SQL<span style="letter-spacing:4pt"> </span>commands:<span style="letter-spacing:4pt"> </span><span style="color:#ff0000">DDL,</span><span style="letter-spacing:4pt; color:#ff0000"> </span><span style="color:#ff0000">DML, DCL, TCL, and DQL.</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.15pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">Data</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-2.25pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Definition</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-2pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Language</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-2pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.2pt; color:#ff0000">(DDL)</span>
			</h2>
			<p style="margin:0.5pt 30.9pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:26.8pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>DDL<span style="letter-spacing:-0.55pt"> </span>changes<span style="letter-spacing:-0.55pt"> </span>the<span style="letter-spacing:-0.65pt"> </span>structure<span style="letter-spacing:-0.25pt"> </span>of<span style="letter-spacing:-0.65pt"> </span>the<span style="letter-spacing:-0.65pt"> </span>table<span style="letter-spacing:-0.55pt"> </span>like<span style="letter-spacing:-0.4pt"> </span><span style="color:#ff0000">creating</span><span style="letter-spacing:-0.75pt; color:#ff0000"> </span><span style="color:#ff0000">a table, deleting a table, altering a table</span>, etc.
			</p>
			<p style="margin:22pt 68.1pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:26.8pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>All<span style="letter-spacing:-0.65pt"> </span>the<span style="letter-spacing:-0.6pt"> </span>command<span style="letter-spacing:-0.5pt"> </span>of<span style="letter-spacing:-0.65pt"> </span>DDL<span style="letter-spacing:-0.6pt"> </span>are<span style="letter-spacing:-0.65pt"> </span>auto-committed<span style="letter-spacing:-0.5pt"> </span>that means it permanently save all the changes in the <span style="letter-spacing:-0.1pt">database.</span>
			</p>
			<p style="margin-top:6.5pt; margin-left:43.75pt; margin-bottom:0pt; text-indent:-36.6pt; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:26.8pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Here<span style="letter-spacing:-1.05pt"> </span>are<span style="letter-spacing:-0.95pt"> </span>some<span style="letter-spacing:-0.85pt"> </span>commands<span style="letter-spacing:-0.65pt"> </span>that<span style="letter-spacing:-1pt"> </span>come<span style="letter-spacing:-0.95pt"> </span>under<span style="letter-spacing:-0.65pt"> </span><span style="letter-spacing:-0.2pt">DDL:</span>
			</p>
			<p style="margin-top:6.15pt; margin-left:79.1pt; margin-bottom:0pt; text-indent:-35.35pt; font-size:28pt">
				<span style="font-family:Wingdings"></span><span style="width:13.11pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="letter-spacing:-0.1pt">CREATE</span>
			</p>
			<p style="margin-top:6.15pt; margin-left:79.1pt; margin-bottom:0pt; text-indent:-35.35pt; font-size:28pt">
				<span style="font-family:Wingdings"></span><span style="width:13.11pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="letter-spacing:-0.1pt">ALTER</span>
			</p>
			<p style="margin-top:6.15pt; margin-left:79.1pt; margin-bottom:0pt; text-indent:-35.35pt; font-size:28pt">
				<span style="font-family:Wingdings"></span><span style="width:13.11pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="letter-spacing:-0.2pt">DROP</span>
			</p>
			<p style="margin-top:6.15pt; margin-left:79.1pt; margin-bottom:0pt; text-indent:-35.35pt; font-size:28pt">
				<span style="font-family:Wingdings"></span><span style="width:13.11pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="letter-spacing:-0.1pt">TRUNCATE</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">Data</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-2pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Definition</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.7pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Language</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.7pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">(DDL)-</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.6pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt">CREATE</span>
			</h2>
			<p style="margin-top:23.9pt; margin-left:7.15pt; margin-bottom:0pt; font-size:28pt">
				<strong>CREATE</strong><strong><span style="letter-spacing:-0.7pt"> </span></strong>It<span style="letter-spacing:-1pt"> </span>is<span style="letter-spacing:-0.75pt"> </span>used<span style="letter-spacing:-0.7pt"> </span>to<span style="letter-spacing:-0.85pt"> </span>create<span style="letter-spacing:-1pt"> </span>a<span style="letter-spacing:-0.9pt"> </span>new<span style="letter-spacing:-0.85pt"> </span>table<span style="letter-spacing:-0.8pt"> </span>in<span style="letter-spacing:-0.8pt"> </span>the<span style="letter-spacing:-0.8pt"> </span><span style="letter-spacing:-0.1pt">database.</span>
			</p>
			<p style="margin-top:5.65pt; margin-bottom:0pt; font-size:28pt">
				&#xa0;
			</p>
			<h4 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Syntax:</span>
			</h4>
			<p style="margin-top:5.25pt; margin-left:43.75pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">REATE</span><span style="letter-spacing:-1.25pt"> </span><span style="letter-spacing:-0.1pt">TABLE</span><span style="letter-spacing:-1.05pt"> </span><span style="letter-spacing:-0.1pt">TABLE_NAME</span><span style="letter-spacing:-0.95pt"> </span><span style="letter-spacing:-0.1pt">(COLUMN_NAME</span><span style="letter-spacing:-1.1pt"> </span><span style="letter-spacing:-0.1pt">DATATYPES[,.</span><span style="width:4.72pt; font-family:'Lucida Console'; display:inline-block">&#xa0;</span><span style="letter-spacing:-0.25pt">]);</span>
			</p>
			<p style="margin-top:10.55pt; margin-bottom:0pt; font-size:24pt">
				&#xa0;
			</p>
			<h4 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Example:</span>
			</h4>
			<p style="margin-top:5.7pt; margin-left:43.75pt; margin-bottom:0pt; line-height:98%; font-size:24pt">
				<span style="letter-spacing:-0.1pt">CREATE</span><span style="letter-spacing:-1.15pt"> </span><span style="letter-spacing:-0.1pt">TABLE</span><span style="letter-spacing:-0.95pt"> </span><span style="letter-spacing:-0.1pt">EMPLOYEE(Name</span><span style="letter-spacing:-0.95pt"> </span><span style="letter-spacing:-0.1pt">VARCHAR2(20),</span><span style="letter-spacing:-1.2pt"> </span><span style="letter-spacing:-0.1pt">Email</span><span style="letter-spacing:-1.15pt"> </span><span style="letter-spacing:-0.1pt">VARCHA </span>R2(100), DOB DATE);
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="height:0pt; display:block; position:absolute; z-index:-23"><img src="data:image/png;base64," width="960" height="360" alt="" style="margin-top:240pt; margin-left:-37.15pt; position:absolute" ></span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Data</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-2pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Definition</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.7pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Language</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.7pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">(DDL)-</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.6pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.2pt">Drop</span>
			</h2>
			<p style="margin-top:24.45pt; margin-left:7.15pt; margin-bottom:0pt; line-height:98%; font-size:28pt">
				Drop:<span style="letter-spacing:-0.45pt"> </span>It<span style="letter-spacing:-0.65pt"> </span>is<span style="letter-spacing:-0.5pt"> </span>used<span style="letter-spacing:-0.4pt"> </span>to<span style="letter-spacing:-0.6pt"> </span>delete<span style="letter-spacing:-0.6pt"> </span>both<span style="letter-spacing:-0.4pt"> </span>the<span style="letter-spacing:-0.5pt"> </span>structure<span style="letter-spacing:-0.3pt"> </span>and<span style="letter-spacing:-0.35pt"> </span>record stored in the table.
			</p>
			<p style="margin-top:11.65pt; margin-bottom:0pt; font-size:28pt">
				&#xa0;
			</p>
			<h4 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Syntax:</span>
			</h4>
			<p style="margin-top:5.25pt; margin-left:43.75pt; margin-bottom:0pt; font-size:24pt">
				DROP<span style="letter-spacing:-1.4pt"> </span>TABLE<span style="letter-spacing:-1.15pt"> </span><span style="letter-spacing:-0.5pt">;</span>
			</p>
			<p style="margin-top:10.55pt; margin-bottom:0pt; font-size:24pt">
				&#xa0;
			</p>
			<h4 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Example:</span>
			</h4>
			<p style="margin-top:5.25pt; margin-left:43.75pt; margin-bottom:0pt; font-size:24pt">
				DROP<span style="letter-spacing:-1.4pt"> </span>TABLE<span style="letter-spacing:-1.15pt"> </span><span style="letter-spacing:-0.1pt">EMPLOYEE;</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">Data</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-2pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Definition</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.7pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Language</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.7pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">(DDL)-</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.6pt; color:#ff0000"> </span><span style="font-size:40pt; letter-spacing:-0.1pt">ALTER</span>
			</h2>
			<p style="margin:24.45pt 17.75pt 0pt 7.15pt; line-height:98%; font-size:24pt">
				<strong>ALTER:</strong><strong><span style="letter-spacing:-0.7pt"> </span></strong>It<span style="letter-spacing:-0.65pt"> </span>is<span style="letter-spacing:-0.55pt"> </span>used<span style="letter-spacing:-0.55pt"> </span>to<span style="letter-spacing:-0.55pt"> </span>alter<span style="letter-spacing:-0.6pt"> </span>the<span style="letter-spacing:-0.5pt"> </span>structure<span style="letter-spacing:-0.7pt"> </span>of<span style="letter-spacing:-0.45pt"> </span>the<span style="letter-spacing:-0.6pt"> </span>database.<span style="letter-spacing:-0.55pt"> </span>This<span style="letter-spacing:-0.5pt"> </span>change could be either to <span style="color:#ff0000">modify </span>the characteristics<span style="letter-spacing:-0.1pt"> </span>of an existing attribute or probably to <span style="color:#ff0000">add a new attribute</span>.
			</p>
			<p style="margin-top:10.8pt; margin-bottom:0pt; font-size:24pt">
				&#xa0;
			</p>
			<h4 style="margin-top:0.05pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Syntax:</span>
			</h4>
			<p style="margin:9.05pt 96.1pt 0pt 43.75pt; line-height:142%; font-size:20pt">
				ALTER<span style="letter-spacing:-1.15pt"> </span>TABLE<span style="letter-spacing:-1.15pt"> </span>table_name<span style="letter-spacing:-1pt"> </span>ADD<span style="letter-spacing:-1.1pt"> </span>column_name<span style="letter-spacing:-1.1pt"> </span>COLUMN-definition; ALTER TABLE MODIFY(COLUMN DEFINITION              <span style="letter-spacing:-0.3pt">);</span>
			</p>
			<p style="margin-top:6.1pt; margin-bottom:0pt; font-size:20pt">
				&#xa0;
			</p>
			<h4 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Example:</span>
			</h4>
			<p style="margin-top:5.3pt; margin-left:53.85pt; margin-bottom:0pt; text-indent:-1.8pt; line-height:118%; font-size:24pt">
				ALTER<span style="letter-spacing:-0.2pt"> </span>TABLE STU_DETAILS ADD(ADDRESS<span style="letter-spacing:-0.45pt"> </span>VARCHAR2(20)); <span style="letter-spacing:-0.1pt">ALTER</span><span style="letter-spacing:-1pt"> </span><span style="letter-spacing:-0.1pt">TABLE</span><span style="letter-spacing:-0.8pt"> </span><span style="letter-spacing:-0.1pt">STU_DETAILS</span><span style="letter-spacing:-0.85pt"> </span><span style="letter-spacing:-0.1pt">MODIFY</span><span style="letter-spacing:-1pt"> </span><span style="letter-spacing:-0.1pt">(NAME</span><span style="letter-spacing:-1pt"> </span><span style="letter-spacing:-0.1pt">VARCHAR2(20));</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">Data</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-2pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Definition</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.7pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Language</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.7pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">(DDL)-</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.6pt; color:#ff0000"> </span><span style="font-size:24pt; letter-spacing:-0.1pt">TRUNCATE</span>
			</h2>
			<p style="margin-top:24.45pt; margin-left:7.15pt; margin-bottom:0pt; line-height:98%; font-size:24pt">
				<strong>TRUNCATE:</strong><strong><span style="letter-spacing:-0.7pt"> </span></strong>It<span style="letter-spacing:-0.55pt"> </span>is<span style="letter-spacing:-0.65pt"> </span>used<span style="letter-spacing:-0.45pt"> </span>to<span style="letter-spacing:-0.55pt"> </span><span style="color:#ff0000">delete</span><span style="letter-spacing:-0.6pt; color:#ff0000"> </span><span style="color:#ff0000">all</span><span style="letter-spacing:-0.65pt; color:#ff0000"> </span><span style="color:#ff0000">the</span><span style="letter-spacing:-0.5pt; color:#ff0000"> </span><span style="color:#ff0000">rows</span><span style="letter-spacing:-0.35pt; color:#ff0000"> </span>from<span style="letter-spacing:-0.6pt"> </span>the<span style="letter-spacing:-0.5pt"> </span>table<span style="letter-spacing:-0.6pt"> </span>and<span style="letter-spacing:-0.55pt"> </span>free the space containing the table.
			</p>
			<p style="margin-top:10.75pt; margin-bottom:0pt; font-size:24pt">
				&#xa0;
			</p>
			<h4 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Syntax:</span>
			</h4>
			<p style="margin-top:9.05pt; margin-left:48.1pt; margin-bottom:0pt; font-size:20pt">
				<span style="letter-spacing:-0.2pt">TRUNCATE</span><span style="letter-spacing:-0.55pt"> </span><span style="letter-spacing:-0.2pt">TABLE</span><span style="letter-spacing:-0.45pt"> </span><span style="letter-spacing:-0.2pt">table_name;</span>
			</p>
			<p style="margin-top:16.5pt; margin-bottom:0pt; font-size:20pt">
				&#xa0;
			</p>
			<h4 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Example:</span>
			</h4>
			<p style="margin-top:5.25pt; margin-left:57.35pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.2pt">TRUNCATE</span><span style="letter-spacing:-0.8pt"> </span><span style="letter-spacing:-0.2pt">TABLE</span><span style="letter-spacing:-0.65pt"> </span><span style="letter-spacing:-0.2pt">EMPLOYEE;</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">Data</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.8pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">Manipulation</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.55pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">Language</span>
			</h2>
			<p style="margin:24.45pt 20.35pt 0pt 43.15pt; text-indent:-36pt; line-height:98%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:26.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>DML<span style="letter-spacing:-0.4pt"> </span>commands<span style="letter-spacing:-0.15pt"> </span>are<span style="letter-spacing:-0.6pt"> </span>used<span style="letter-spacing:-0.3pt"> </span>to<span style="letter-spacing:-0.5pt"> </span>modify<span style="letter-spacing:-0.35pt"> </span>the<span style="letter-spacing:-0.4pt"> </span>database.<span style="letter-spacing:-0.4pt"> </span>It<span style="letter-spacing:-0.6pt"> </span>is responsible for all form of <span style="color:#ff0000">CHANGES</span><span style="letter-spacing:4pt; color:#ff0000"> </span>in the database.
			</p>
			<p style="margin:29.95pt 16.85pt 0pt 43.15pt; text-indent:-36pt; line-height:98%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:26.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>The command of <strong><span style="color:#0070bf">DML is not auto-committed </span></strong>that means<span style="letter-spacing:-0.5pt"> </span>it<span style="letter-spacing:-0.4pt"> </span>can't<span style="letter-spacing:-0.55pt"> </span>permanently<span style="letter-spacing:-0.2pt"> </span>save<span style="letter-spacing:-0.5pt"> </span>all<span style="letter-spacing:-0.6pt"> </span>the<span style="letter-spacing:-0.5pt"> </span>changes<span style="letter-spacing:-0.3pt"> </span>in<span style="letter-spacing:-0.45pt"> </span>the database. They can be rollback.
			</p>
			<p style="margin-top:6pt; margin-bottom:0pt; font-size:28pt">
				&#xa0;
			</p>
			<p style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				Here<span style="letter-spacing:-0.35pt"> </span>are<span style="letter-spacing:-0.3pt"> </span>some<span style="letter-spacing:-0.45pt"> </span>commands<span style="letter-spacing:-0.5pt"> </span>that<span style="letter-spacing:-0.5pt"> </span>come<span style="letter-spacing:-0.4pt"> </span>under<span style="letter-spacing:-0.25pt"> </span><span style="letter-spacing:-0.2pt">DML:</span>
			</p>
			<p style="margin-top:5.25pt; margin-left:79.15pt; margin-bottom:0pt; text-indent:-35.4pt; font-size:24pt">
				<span style="font-family:Wingdings; color:#ff0000"></span><span style="width:16.33pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><strong><span style="letter-spacing:-0.1pt; color:#ff0000">INSERT</span></strong>
			</p>
			<p style="margin-top:5.3pt; margin-left:79.15pt; margin-bottom:0pt; text-indent:-35.4pt; font-size:24pt">
				<span style="font-family:Wingdings; color:#00af4f"></span><span style="width:16.33pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><strong><span style="letter-spacing:-0.1pt; color:#00af4f">UPDATE</span></strong>
			</p>
			<p style="margin-top:5.25pt; margin-left:79.15pt; margin-bottom:0pt; text-indent:-35.4pt; font-size:24pt">
				<span style="font-family:Wingdings; color:#ff0000"></span><span style="width:16.33pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><strong><span style="letter-spacing:-0.1pt; color:#ff0000">DELETE</span></strong>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">Data</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.95pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Manipulation</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.65pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Language</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.55pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">-</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.7pt; color:#ff0000"> </span><span style="font-size:40pt; letter-spacing:-0.1pt">INSERT</span>
			</h2>
			<p style="margin:24.45pt 17.75pt 0pt 7.15pt; line-height:98%; font-size:24pt">
				<strong>INSERT:</strong><strong><span style="letter-spacing:-0.85pt"> </span></strong>The<span style="letter-spacing:-0.4pt"> </span>INSERT<span style="letter-spacing:-0.6pt"> </span>statement<span style="letter-spacing:-0.8pt"> </span>is<span style="letter-spacing:-0.7pt"> </span>a<span style="letter-spacing:-0.55pt"> </span>SQL<span style="letter-spacing:-0.7pt"> </span>query.<span style="letter-spacing:-0.6pt"> </span>It<span style="letter-spacing:-0.7pt"> </span>is<span style="letter-spacing:-0.6pt"> </span>used<span style="letter-spacing:-0.55pt"> </span>to<span style="letter-spacing:-0.6pt"> </span>insert data into the row of a table.
			</p>
			<h4 style="margin-top:5.5pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Syntax:</span>
			</h4>
			<p style="margin-top:5.25pt; margin-left:84pt; margin-bottom:0pt; font-size:24pt">
				INSERT<span style="letter-spacing:-0.85pt"> </span>INTO<span style="letter-spacing:-0.6pt"> </span><span style="letter-spacing:-0.1pt">TABLE_NAME</span><span style="width:18.6pt; display:inline-block">&#xa0;</span>(col1,<span style="letter-spacing:-0.75pt"> </span>col2,<span style="letter-spacing:-0.6pt"> </span>col3,....<span style="letter-spacing:-0.5pt"> </span>col<span style="letter-spacing:-0.6pt"> </span><span style="letter-spacing:-0.25pt">N)</span>
			</p>
			<p style="margin-top:5.25pt; margin-left:79.15pt; margin-bottom:0pt; font-size:24pt">
				VALUES<span style="letter-spacing:-1.35pt"> </span>(value1,<span style="letter-spacing:-0.95pt"> </span>value2,<span style="letter-spacing:-0.9pt"> </span><span style="letter-spacing:-0.1pt">value3,</span><span style="width:31.82pt; font-family:'Lucida Console'; display:inline-block">..</span><span style="letter-spacing:-0.1pt">valueN);</span>
			</p>
			<p style="margin:8pt 15.3pt 0pt 6.15pt; text-align:center; font-size:36pt">
				<span style="letter-spacing:-0.25pt; color:#ff0000">OR</span>
			</p>
			<p style="margin-top:4.3pt; margin-left:36.35pt; margin-bottom:0pt; font-size:20pt">
				INSERT<span style="letter-spacing:-0.8pt"> </span>INTO<span style="letter-spacing:-0.65pt"> </span><span style="letter-spacing:-0.1pt">TABLE_NAME</span><span style="width:15.53pt; display:inline-block">&#xa0;</span>VALUES<span style="letter-spacing:-1.05pt"> </span>(value1,<span style="letter-spacing:-0.9pt"> </span>value2,<span style="letter-spacing:-0.85pt"> </span><span style="letter-spacing:-0.1pt">value3,</span><span style="width:26.84pt; font-family:'Lucida Console'; font-size:10pt; display:inline-block">....</span><span style="letter-spacing:-0.1pt">valueN);</span>
			</p>
			<p style="margin-top:15.4pt; margin-bottom:0pt; font-size:20pt">
				&#xa0;
			</p>
			<h4 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:29.05pt">
				<span style="font-size:24pt; letter-spacing:-0.1pt">Example:</span>
			</h4>
			<p style="margin-top:0pt; margin-left:43.75pt; margin-bottom:0pt; line-height:29.05pt">
				<span style="font-size:24pt">INSERT</span><span style="font-size:24pt; letter-spacing:-1.2pt"> </span><span style="font-size:24pt">INTO</span><span style="font-size:24pt; letter-spacing:-0.9pt"> </span><span style="font-size:24pt">XYZ</span><span style="font-size:24pt; letter-spacing:-0.8pt"> </span><span style="font-size:24pt">(Author,</span><span style="font-size:24pt; letter-spacing:-1pt"> </span><span style="font-size:24pt">Subject)</span><span style="font-size:24pt; letter-spacing:-1pt"> </span><span style="font-size:24pt">VALUES</span><span style="font-size:24pt; letter-spacing:-1.05pt"> </span><span style="font-size:24pt">("Sonoo",</span><span style="font-size:24pt; letter-spacing:-0.85pt"> </span><span style="font-size:24pt; letter-spacing:-0.1pt">"DBMS");</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">Data</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.95pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Manipulation</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.65pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Language</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.55pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">-</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.7pt; color:#ff0000"> </span><span style="font-size:40pt; letter-spacing:-0.1pt">UPDATE</span>
			</h2>
			<p style="margin-top:24.45pt; margin-left:7.15pt; margin-bottom:0pt; line-height:98%; font-size:24pt">
				Update:<span style="letter-spacing:-0.55pt"> </span>This<span style="letter-spacing:-0.25pt"> </span>command<span style="letter-spacing:-0.5pt"> </span>is<span style="letter-spacing:-0.5pt"> </span>used<span style="letter-spacing:-0.3pt"> </span>to<span style="letter-spacing:-0.4pt"> </span><strong><span style="color:#ff0000">update</span></strong><strong><span style="letter-spacing:-0.3pt; color:#ff0000"> </span></strong><strong><span style="color:#ff0000">or</span></strong><strong><span style="letter-spacing:-0.5pt; color:#ff0000"> </span></strong><strong><span style="color:#ff0000">modify</span></strong><strong><span style="letter-spacing:-0.35pt; color:#ff0000"> </span></strong>the<span style="letter-spacing:-0.35pt"> </span>value<span style="letter-spacing:-0.25pt"> </span>of<span style="letter-spacing:-0.4pt"> </span>a column in the table.
			</p>
			<h4 style="margin-top:5.5pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Syntax:</span>
			</h4>
			<p style="margin-top:5.7pt; margin-left:43.75pt; margin-bottom:0pt; line-height:98%; font-size:24pt">
				UPDATE<span style="letter-spacing:-1.4pt"> </span>table_name<span style="letter-spacing:-1.35pt"> </span>SET<span style="letter-spacing:-1.35pt"> </span>[column_name1=<span style="letter-spacing:-1.35pt"> </span>value1,...column_n ameN = valueN] [WHERE CONDITION]
			</p>
			<p style="margin-top:10.75pt; margin-bottom:0pt; font-size:24pt">
				&#xa0;
			</p>
			<h4 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Example:</span>
			</h4>
			<p style="margin-top:5.25pt; margin-left:79.65pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.25pt">UPDATE</span><span style="letter-spacing:-0.9pt"> </span><span style="letter-spacing:-0.1pt">students</span>
			</p>
			<p style="margin:5.25pt 288.8pt 0pt 74.35pt; line-height:118%; font-size:24pt">
				SET<span style="letter-spacing:-0.85pt"> </span>User_Name<span style="letter-spacing:-0.55pt"> </span>=<span style="letter-spacing:-0.8pt"> </span>'Sonoo' WHERE Student_Id = '3'
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">Data</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-2.2pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Control</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-2pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">Language</span>
			</h2>
			<p style="margin-top:24.45pt; margin-left:7.15pt; margin-bottom:0pt; line-height:98%; font-size:28pt">
				DCL<span style="letter-spacing:-0.75pt"> </span>commands<span style="letter-spacing:-0.45pt"> </span>are<span style="letter-spacing:-0.85pt"> </span>used<span style="letter-spacing:-0.6pt"> </span>to<span style="letter-spacing:-0.7pt"> </span>GRANT<span style="letter-spacing:-0.55pt"> </span>and<span style="letter-spacing:-0.6pt"> </span>TAKE<span style="letter-spacing:-0.85pt"> </span>BACK authority from any database user.
			</p>
			<p style="margin-top:12.5pt; margin-bottom:0pt; font-size:28pt">
				&#xa0;
			</p>
			<p style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; font-size:28pt">
				Here<span style="letter-spacing:-1.05pt"> </span>are<span style="letter-spacing:-0.95pt"> </span>some<span style="letter-spacing:-0.85pt"> </span>commands<span style="letter-spacing:-0.65pt"> </span>that<span style="letter-spacing:-1pt"> </span>come<span style="letter-spacing:-0.95pt"> </span>under<span style="letter-spacing:-0.65pt"> </span><span style="letter-spacing:-0.2pt">DCL:</span>
			</p>
			<p style="margin-top:6.15pt; margin-left:66.05pt; margin-bottom:0pt; text-indent:-22.3pt; font-size:28pt">
				<span style="font-family:Wingdings; font-size:27pt; letter-spacing:0.1pt"></span><span style="width:0.85pt; font:7pt 'Times New Roman'; display:inline-block"> </span><span style="letter-spacing:-0.1pt">Grant</span>
			</p>
			<p style="margin-top:12.3pt; margin-bottom:0pt; font-size:28pt">
				&#xa0;
			</p>
			<p style="margin-top:0pt; margin-left:66.05pt; margin-bottom:0pt; text-indent:-22.3pt; font-size:28pt">
				<span style="font-family:Wingdings; font-size:27pt; letter-spacing:0.1pt"></span><span style="width:0.85pt; font:7pt 'Times New Roman'; display:inline-block"> </span><span style="letter-spacing:-0.1pt">Revoke</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">Data</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.75pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Control</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.45pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Language</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.45pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">-</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.45pt; color:#ff0000"> </span><span style="font-size:40pt; letter-spacing:-0.1pt">Grant</span>
			</h2>
			<p style="margin-top:24pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<strong>GRANT:</strong><strong><span style="letter-spacing:-0.8pt"> </span></strong>It<span style="letter-spacing:-0.3pt"> </span>is<span style="letter-spacing:-0.5pt"> </span>used<span style="letter-spacing:-0.2pt"> </span>to<span style="letter-spacing:-0.55pt"> </span>give<span style="letter-spacing:-0.15pt"> </span>user<span style="letter-spacing:-0.45pt"> </span>access<span style="letter-spacing:-0.45pt"> </span>privileges<span style="letter-spacing:-0.35pt"> </span>to<span style="letter-spacing:-0.4pt"> </span>a<span style="letter-spacing:-0.3pt"> </span><span style="letter-spacing:-0.1pt">database.</span>
			</p>
			<p style="margin-top:10.5pt; margin-bottom:0pt; font-size:24pt">
				&#xa0;
			</p>
			<h4 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Example:</span>
			</h4>
			<p style="margin-top:5.75pt; margin-left:43.75pt; margin-bottom:0pt; line-height:98%; font-size:24pt">
				GRANT<span style="letter-spacing:-1.4pt"> </span>SELECT,<span style="letter-spacing:-1.35pt"> </span>UPDATE<span style="letter-spacing:-1.35pt"> </span>ON<span style="letter-spacing:-1.35pt"> </span>MY_TABLE<span style="letter-spacing:-1.35pt"> </span>TO<span style="letter-spacing:-1.35pt"> </span>SOME_USER,<span style="letter-spacing:-1.35pt"> </span>ANOT <span style="letter-spacing:-0.1pt">HER_USER;</span>
			</p>
			<p style="margin-top:10.7pt; margin-bottom:0pt; font-size:24pt">
				&#xa0;
			</p>
			<p style="margin-top:0.05pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<strong>REVOKE:</strong><strong><span style="letter-spacing:-0.45pt"> </span></strong>It<span style="letter-spacing:-0.5pt"> </span>is<span style="letter-spacing:-0.4pt"> </span>used<span style="letter-spacing:-0.3pt"> </span>to<span style="letter-spacing:-0.55pt"> </span>take<span style="letter-spacing:-0.55pt"> </span>back<span style="letter-spacing:-0.55pt"> </span>permissions<span style="letter-spacing:-0.4pt"> </span>from<span style="letter-spacing:-0.5pt"> </span>the<span style="letter-spacing:-0.3pt"> </span><span style="letter-spacing:-0.1pt">user.</span>
			</p>
			<p style="margin-top:10.5pt; margin-bottom:0pt; font-size:24pt">
				&#xa0;
			</p>
			<h4 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Example:</span>
			</h4>
			<p style="margin-top:10.5pt; margin-bottom:0pt; font-size:24pt">
				<strong>&#xa0;</strong>
			</p>
			<p style="margin-top:0.05pt; margin-left:39.1pt; margin-bottom:0pt; font-size:24pt">
				REVOKE<span style="letter-spacing:-1.45pt"> </span>SELECT,<span style="letter-spacing:-1.35pt"> </span>UPDATE<span style="letter-spacing:-1.15pt"> </span>ON<span style="letter-spacing:-1.25pt"> </span>MY_TABLE<span style="letter-spacing:-1pt"> </span>FROM<span style="letter-spacing:-1.35pt"> </span>USER1,<span style="letter-spacing:-1.3pt"> </span><span style="letter-spacing:-0.1pt">USER2;</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="height:0pt; display:block; position:absolute; z-index:-22"><img src="data:image/png;base64," width="960" height="360" alt="" style="margin-top:240pt; margin-left:-37.15pt; position:absolute" ></span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.3pt; color:#ff0000">Transaction</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.35pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.3pt; color:#ff0000">Control</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.25pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.3pt; color:#ff0000">Language</span>
			</h2>
			<p style="margin-top:24.45pt; margin-left:7.15pt; margin-bottom:0pt; line-height:98%; font-size:28pt">
				TCL<span style="letter-spacing:-0.7pt"> </span>commands<span style="letter-spacing:-0.3pt"> </span>can<span style="letter-spacing:-0.65pt"> </span>only<span style="letter-spacing:-0.4pt"> </span><span style="color:#ff0000">use</span><span style="letter-spacing:-0.55pt; color:#ff0000"> </span><span style="color:#ff0000">with</span><span style="letter-spacing:-0.6pt; color:#ff0000"> </span><span style="color:#ff0000">DML</span><span style="letter-spacing:-0.45pt; color:#ff0000"> </span><span style="color:#ff0000">commands</span><span style="letter-spacing:-0.3pt; color:#ff0000"> </span><span style="color:#ff0000">like INSERT,</span><span style="letter-spacing:-0.3pt; color:#ff0000"> </span><span style="color:#ff0000">DELETE</span><span style="letter-spacing:-0.3pt; color:#ff0000"> </span><span style="color:#ff0000">and</span><span style="letter-spacing:-0.15pt; color:#ff0000"> </span><span style="color:#ff0000">UPDATE</span><span style="letter-spacing:-0.1pt; color:#ff0000"> </span><span style="color:#ff0000">only.</span>
			</p>
			<p style="margin-top:6.9pt; margin-left:7.15pt; margin-bottom:0pt; line-height:98%; font-size:28pt">
				These operations are automatically committed in the database<span style="letter-spacing:-0.65pt"> </span>that's<span style="letter-spacing:-0.6pt"> </span>why<span style="letter-spacing:-0.65pt"> </span>they<span style="letter-spacing:-0.7pt"> </span>cannot<span style="letter-spacing:-0.5pt"> </span>be<span style="letter-spacing:-0.65pt"> </span>used<span style="letter-spacing:-0.4pt"> </span>while<span style="letter-spacing:-0.65pt"> </span>creating tables or dropping them.
			</p>
			<p style="margin-top:6.5pt; margin-left:7.15pt; margin-bottom:0pt; font-size:28pt">
				Here<span style="letter-spacing:-1.05pt"> </span>are<span style="letter-spacing:-0.95pt"> </span>some<span style="letter-spacing:-0.85pt"> </span>commands<span style="letter-spacing:-0.65pt"> </span>that<span style="letter-spacing:-1pt"> </span>come<span style="letter-spacing:-0.95pt"> </span>under<span style="letter-spacing:-0.65pt"> </span><span style="letter-spacing:-0.2pt">TCL:</span>
			</p>
			<p style="margin-top:6.15pt; margin-left:74.3pt; margin-bottom:0pt; text-indent:-30.55pt; font-size:28pt">
				<span style="font-family:Wingdings; font-size:27pt; letter-spacing:0.1pt"></span><span style="width:9.1pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="letter-spacing:-0.1pt">COMMIT</span>
			</p>
			<p style="margin-top:6.15pt; margin-left:79.1pt; margin-bottom:0pt; text-indent:-35.35pt; font-size:28pt">
				<span style="font-family:Wingdings; font-size:27pt; letter-spacing:0.1pt"></span><span style="width:13.9pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="letter-spacing:-0.1pt">ROLLBACK</span>
			</p>
			<p style="margin-top:6.15pt; margin-left:79.1pt; margin-bottom:0pt; text-indent:-35.35pt; font-size:28pt">
				<span style="font-family:Wingdings; font-size:27pt; letter-spacing:0.1pt"></span><span style="width:13.9pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="letter-spacing:-0.1pt">SAVEPOINT</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">Transaction</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.9pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">Control</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.85pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">Language</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.5pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">-</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.8pt; color:#ff0000"> </span><span style="font-size:32pt; font-weight:normal; letter-spacing:-0.1pt">COMMIT</span>
			</h2>
			<p style="margin:24.45pt 17.75pt 0pt 7.15pt; line-height:98%; font-size:24pt">
				<strong><span style="color:#ff0000">Commit:</span></strong><strong><span style="letter-spacing:-0.6pt; color:#ff0000"> </span></strong>Commit<span style="letter-spacing:-0.7pt"> </span>command<span style="letter-spacing:-0.6pt"> </span>is<span style="letter-spacing:-0.6pt"> </span>used<span style="letter-spacing:-0.35pt"> </span>to<span style="letter-spacing:-0.65pt"> </span>save<span style="letter-spacing:-0.4pt"> </span>all<span style="letter-spacing:-0.45pt"> </span>the<span style="letter-spacing:-0.55pt"> </span>transactions<span style="letter-spacing:-0.6pt"> </span>to the database.
			</p>
			<h4 style="margin-top:5.5pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Syntex:</span>
			</h4>
			<p style="margin-top:5.25pt; margin-left:43.75pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">COMMIT;</span>
			</p>
			<h4 style="margin-top:5.25pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Example:</span>
			</h4>
			<p style="margin:5.25pt 358.25pt 0pt 52.05pt; line-height:118%; font-size:24pt">
				DELETE<span style="letter-spacing:-1.4pt"> </span>FROM<span style="letter-spacing:-1.35pt"> </span>CUSTOMERS WHERE AGE = 25; <span style="letter-spacing:-0.1pt">COMMIT;</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<p style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; letter-spacing:-0.1pt; color:#ff0000">Transaction</span><span style="font-size:40pt; letter-spacing:-1.9pt; color:#ff0000"> </span><span style="font-size:40pt; letter-spacing:-0.1pt; color:#ff0000">Control</span><span style="font-size:40pt; letter-spacing:-1.85pt; color:#ff0000"> </span><span style="font-size:40pt; letter-spacing:-0.1pt; color:#ff0000">Language</span><span style="font-size:40pt; letter-spacing:-1.5pt; color:#ff0000"> </span><span style="font-size:40pt; letter-spacing:-0.1pt; color:#ff0000">-</span><span style="font-size:40pt; letter-spacing:-1.8pt; color:#ff0000"> </span><strong><span style="font-size:32pt; letter-spacing:-0.1pt">Rollback</span></strong>
			</p>
			<p style="margin-top:11.65pt; margin-bottom:0pt; font-size:10pt">
				<strong>&#xa0;</strong>
			</p>
		</div>
		<br style="clear:both; mso-break-type:section-break" >
		<div>
			<p style="margin:0.6pt 3pt 0pt 7.15pt; line-height:98%; font-size:24pt">
				<strong><span style="color:#ff0000">Rollback:</span></strong><strong><span style="letter-spacing:-1.35pt; color:#ff0000"> </span></strong>Rollback<span style="letter-spacing:-1.3pt"> </span>command<span style="letter-spacing:-1.3pt"> </span>is used<span style="letter-spacing:-0.35pt"> </span>to<span style="letter-spacing:-0.25pt"> </span>undo<span style="letter-spacing:-0.15pt"> </span>transactions<span style="letter-spacing:-0.45pt"> </span>that have not already been saved to the database.
			</p>
			<h4 style="margin-top:5.65pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Syntex:</span>
			</h4>
			<p style="margin-top:5.25pt; margin-left:43.75pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">ROLLBACK;</span>
			</p>
			<p style="margin-top:10.55pt; margin-bottom:0pt; font-size:24pt">
				&#xa0;
			</p>
			<h4 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Example:</span>
			</h4>
			<p style="margin-top:5.25pt; margin-left:43.75pt; margin-bottom:0pt; line-height:118%; font-size:24pt">
				DELETE<span style="letter-spacing:-1.4pt"> </span>FROM<span style="letter-spacing:-1.35pt"> </span>CUSTOMERS WHERE AGE = 25; <span style="letter-spacing:-0.1pt">ROLLBACK;</span>
			</p>
			<p style="margin:0.6pt 15.9pt 0pt 7.15pt; line-height:98%; font-size:24pt">
				<br style="clear:both; mso-column-break-before:always" ><strong><span style="color:#ff0000">SAVEPOINT:</span></strong><strong><span style="letter-spacing:-1.05pt; color:#ff0000"> </span></strong>It<span style="letter-spacing:-0.9pt"> </span>is<span style="letter-spacing:-1.05pt"> </span>used<span style="letter-spacing:-0.8pt"> </span>to<span style="letter-spacing:-1.05pt"> </span>roll<span style="letter-spacing:-0.9pt"> </span>the transaction back to a certain point without rolling back the entire transaction.
			</p>
			<h4 style="margin-top:5.65pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Syntex:</span>
			</h4>
			<p style="margin:5.7pt 39.25pt 0pt 43.8pt; line-height:98%; font-size:24pt">
				<span style="letter-spacing:-0.1pt">SAVEPOINT</span><span style="letter-spacing:-1.3pt"> </span><span style="letter-spacing:-0.1pt">SAVEPOINT_NA </span><span style="letter-spacing:-0.2pt">ME;</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">Data</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.6pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Query</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.15pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">Language</span>
			</h2>
			<p style="margin:24pt 186.75pt 0pt 7.15pt; line-height:118%; font-size:24pt">
				DQL<span style="letter-spacing:-0.75pt"> </span>is<span style="letter-spacing:-0.6pt"> </span>used<span style="letter-spacing:-0.45pt"> </span>to<span style="letter-spacing:-0.7pt"> </span>fetch<span style="letter-spacing:-0.7pt"> </span>the<span style="letter-spacing:-0.5pt"> </span>data<span style="letter-spacing:-0.65pt"> </span>from<span style="letter-spacing:-0.65pt"> </span>the<span style="letter-spacing:-0.5pt"> </span>database. It uses only one command:
			</p>
			<p style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:29.3pt">
				<span style="font-size:24pt; letter-spacing:-0.1pt">SELECT</span>
			</p>
			<p style="margin:5.7pt 53.45pt 0pt 43.15pt; text-indent:-36pt; line-height:98%; font-size:24pt">
				<strong><span style="letter-spacing:-0.3pt">a.</span></strong><strong><span style="width:17.74pt; text-indent:0pt; display:inline-block">&#xa0;</span></strong><strong>SELECT: </strong>This is the same as the projection operation of relational<span style="letter-spacing:-0.7pt"> </span>algebra.<span style="letter-spacing:-0.55pt"> </span>It<span style="letter-spacing:-0.65pt"> </span>is<span style="letter-spacing:-0.55pt"> </span>used<span style="letter-spacing:-0.5pt"> </span>to<span style="letter-spacing:-0.55pt"> </span>select<span style="letter-spacing:-0.65pt"> </span>the<span style="letter-spacing:-0.6pt"> </span>attribute<span style="letter-spacing:-0.6pt"> </span>based<span style="letter-spacing:-0.5pt"> </span>on the condition described by WHERE clause.
			</p>
			<p style="margin-top:10.85pt; margin-bottom:0pt; font-size:24pt">
				&#xa0;
			</p>
			<h4 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Syntax:</span>
			</h4>
			<p style="margin-top:5.25pt; margin-left:79.15pt; margin-bottom:0pt; font-size:24pt">
				SELECT<span style="letter-spacing:-0.5pt"> </span><span style="letter-spacing:-0.1pt">expressions</span><span style="width:20.64pt; display:inline-block">&#xa0;</span>FROM<span style="letter-spacing:-0.6pt"> </span><span style="letter-spacing:-0.1pt">TABLES</span><span style="width:18.98pt; display:inline-block">&#xa0;</span>WHERE<span style="letter-spacing:-0.1pt"> conditions;</span>
			</p>
			<h4 style="margin-top:5.25pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Example:</span>
			</h4>
			<p style="margin-top:5.3pt; margin-left:79.15pt; margin-bottom:0pt; font-size:24pt">
				SELECT<span style="letter-spacing:-0.5pt"> </span>emp_name<span style="letter-spacing:2.35pt"> </span>FROM<span style="letter-spacing:-0.3pt"> </span>employee<span style="letter-spacing:2.25pt"> </span>WHERE<span style="letter-spacing:-0.3pt"> </span>age<span style="letter-spacing:-0.15pt"> </span>&gt;<span style="letter-spacing:-0.15pt"> </span><span style="letter-spacing:-0.25pt">20;</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<p style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; color:#ff0000">SQL</span><span style="font-size:40pt; letter-spacing:-0.8pt; color:#ff0000"> </span><span style="font-size:40pt; letter-spacing:-0.1pt; color:#ff0000">Operator</span>
			</p>
