					<td style="width:124.5pt; border-top:1pt solid #ffffff; border-right:1.5pt solid #ffffff; border-left:1.5pt solid #ffffff; vertical-align:top; background-color:#e8edf4">
						<p style="margin-top:2.35pt; margin-left:0.8pt; margin-bottom:0pt; text-align:center; line-height:38.6pt">
							<span style="font-size:40pt; letter-spacing:-0.5pt">-</span>
						</p>
					</td>
					<td style="width:478.5pt; border-top:1pt solid #ffffff; border-right:1.5pt solid #ffffff; border-left:1.5pt solid #ffffff; vertical-align:top; background-color:#e8edf4">
						<p style="margin-top:0.5pt; margin-left:6.9pt; margin-bottom:0pt; line-height:21.6pt">
							<span style="font-size:18pt">It</span><span style="font-size:18pt; letter-spacing:-0.45pt"> </span><span style="font-size:18pt">is</span><span style="font-size:18pt; letter-spacing:-0.3pt"> </span><span style="font-size:18pt">used</span><span style="font-size:18pt; letter-spacing:-0.3pt"> </span><span style="font-size:18pt">to</span><span style="font-size:18pt; letter-spacing:-0.35pt"> </span><span style="font-size:18pt">subtract</span><span style="font-size:18pt; letter-spacing:-0.25pt"> </span><span style="font-size:18pt">the</span><span style="font-size:18pt; letter-spacing:-0.3pt"> </span><span style="font-size:18pt">right-hand</span><span style="font-size:18pt; letter-spacing:-0.2pt"> </span><span style="font-size:18pt">operand</span><span style="font-size:18pt; letter-spacing:-0.2pt"> </span><span style="font-size:18pt">from</span><span style="font-size:18pt; letter-spacing:-0.3pt"> </span><span style="font-size:18pt">the</span><span style="font-size:18pt; letter-spacing:-0.3pt"> </span><span style="font-size:18pt">left-hand </span><span style="font-size:18pt; letter-spacing:-0.1pt">operand.</span>
						</p>
