				<tr style="height:64.55pt">
					<td colspan="2" style="width:606pt; border-top:1.5pt solid #ffffff; border-bottom:1pt solid #ffffff; vertical-align:top; background-color:#cfd8e8">
						<p style="margin-top:2pt; margin-left:53.45pt; margin-bottom:0pt; font-size:40pt">
							<span style="letter-spacing:-0.5pt; vertical-align:-20pt">*</span><span style="width:60.28pt; vertical-align:-20pt; display:inline-block">&#xa0;</span><span style="font-size:18pt">It</span><span style="font-size:18pt; letter-spacing:-0.4pt"> </span><span style="font-size:18pt">is</span><span style="font-size:18pt; letter-spacing:-0.1pt"> </span><span style="font-size:18pt">used</span><span style="font-size:18pt; letter-spacing:-0.1pt"> </span><span style="font-size:18pt">to</span><span style="font-size:18pt; letter-spacing:-0.15pt"> </span><span style="font-size:18pt">multiply the value</span><span style="font-size:18pt; letter-spacing:-0.1pt"> </span><span style="font-size:18pt">of both </span><span style="font-size:18pt; letter-spacing:-0.1pt">operands.</span>
