							<span style="letter-spacing:-0.5pt; vertical-align:-20pt">/</span><span style="width:62.5pt; text-indent:0pt; vertical-align:-20pt; display:inline-block">&#xa0;</span><span style="line-height:45%; font-size:18pt">It</span><span style="line-height:45%; font-size:18pt; letter-spacing:-0.4pt"> </span><span style="line-height:45%; font-size:18pt">is</span><span style="line-height:45%; font-size:18pt; letter-spacing:-0.25pt"> </span><span style="line-height:45%; font-size:18pt">used</span><span style="line-height:45%; font-size:18pt; letter-spacing:-0.25pt"> </span><span style="line-height:45%; font-size:18pt">to</span><span style="line-height:45%; font-size:18pt; letter-spacing:-0.3pt"> </span><span style="line-height:45%; font-size:18pt">divide</span><span style="line-height:45%; font-size:18pt; letter-spacing:-0.1pt"> </span><span style="line-height:45%; font-size:18pt">the</span><span style="line-height:45%; font-size:18pt; letter-spacing:-0.1pt"> </span><span style="line-height:45%; font-size:18pt">left-hand</span><span style="line-height:45%; font-size:18pt; letter-spacing:-0.25pt"> </span><span style="line-height:45%; font-size:18pt">operand</span><span style="line-height:45%; font-size:18pt; letter-spacing:-0.15pt"> </span><span style="line-height:45%; font-size:18pt">by</span><span style="line-height:45%; font-size:18pt; letter-spacing:-0.15pt"> </span><span style="line-height:45%; font-size:18pt">the</span><span style="line-height:45%; font-size:18pt; letter-spacing:-0.25pt"> </span><span style="line-height:45%; font-size:18pt">right-hand </span><span style="line-height:45%; font-size:18pt; letter-spacing:-0.1pt">operand.</span>
						</p>
					</td>
				</tr>
