			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">Example:</span>
			</h2>
			<p style="margin:24.45pt 30.15pt 0pt 39.1pt; text-indent:-31.95pt; line-height:98%; font-size:20pt">
				<span style="font-family:Arial">•</span><span style="width:24.95pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>UPDATE table_name<span style="width:9.17pt; text-indent:0pt; display:inline-block">&#xa0;</span>SET<span style="letter-spacing:-0.45pt"> </span>column_name<span style="letter-spacing:-0.4pt"> </span>=<span style="letter-spacing:-0.35pt"> </span>value1,<span style="letter-spacing:-0.5pt"> </span>column_name2<span style="letter-spacing:-0.3pt"> </span>=<span style="letter-spacing:-0.35pt"> </span>value WHERE condition;
			</p>
			<p style="margin-top:4.6pt; margin-left:39.1pt; margin-bottom:0pt; text-indent:-31.95pt; font-size:20pt">
				<span style="font-family:Arial">•</span><span style="width:24.95pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>DELETE<span style="letter-spacing:-0.8pt"> </span>FROM<span style="letter-spacing:-0.3pt"> </span>table_name<span style="letter-spacing:-0.1pt"> </span>WHERE<span style="letter-spacing:-0.4pt"> </span><span style="letter-spacing:-0.1pt">some_condition;</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">Views</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.15pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">in</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.05pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.25pt; color:#ff0000">SQL</span>
			</h2>
			<p style="margin:24.45pt 30.55pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:26.8pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Views<span style="letter-spacing:-0.65pt"> </span>in<span style="letter-spacing:-0.45pt"> </span>SQL<span style="letter-spacing:-0.4pt"> </span>are<span style="letter-spacing:-0.5pt"> </span>considered<span style="letter-spacing:-0.2pt"> </span>as<span style="letter-spacing:-0.5pt"> </span>a<span style="letter-spacing:-0.35pt"> </span><span style="color:#ff0000">virtual</span><span style="letter-spacing:-0.35pt; color:#ff0000"> </span><span style="color:#ff0000">table</span>.<span style="letter-spacing:-0.4pt"> </span>A<span style="letter-spacing:-0.5pt"> </span>view also contains rows and columns.
			</p>
			<p style="margin:29.95pt 38.6pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:26.8pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>To<span style="letter-spacing:-1.05pt"> </span>create<span style="letter-spacing:-1.2pt"> </span>the<span style="letter-spacing:-0.9pt"> </span>view,<span style="letter-spacing:-1pt"> </span>we<span style="letter-spacing:-1.05pt"> </span>can<span style="letter-spacing:-0.95pt"> </span>select<span style="letter-spacing:-1pt"> </span>the<span style="letter-spacing:-0.9pt"> </span>fields<span style="letter-spacing:-0.9pt"> </span>from<span style="letter-spacing:-0.9pt"> </span>one or more tables present in the database.
			</p>
			<p style="margin:27.1pt 28.05pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:28pt">
				<span style="font-family:Arial">•</span><span style="width:26.8pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>A<span style="letter-spacing:-0.55pt"> </span>view<span style="letter-spacing:-0.7pt"> </span>can<span style="letter-spacing:-0.55pt"> </span>either<span style="letter-spacing:-0.5pt"> </span>have<span style="letter-spacing:-0.6pt"> </span>specific<span style="letter-spacing:-0.45pt"> </span>rows<span style="letter-spacing:-0.5pt"> </span>based<span style="letter-spacing:-0.4pt"> </span>on<span style="letter-spacing:-0.55pt"> </span>certain condition or all the rows of a table.
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="height:0pt; display:block; position:absolute; z-index:-17"><img src="data:image/png;base64," width="960" height="360" alt="" style="margin-top:240pt; margin-left:-37.15pt; position:absolute" ></span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">Creating</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.9pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.2pt; color:#ff0000">view</span>
			</h2>
			<p style="margin-top:12.45pt; margin-left:7.15pt; margin-bottom:0pt; line-height:98%; font-size:24pt">
				A<span style="letter-spacing:-0.9pt"> </span>view<span style="letter-spacing:-0.7pt"> </span>can<span style="letter-spacing:-0.7pt"> </span>be<span style="letter-spacing:-0.7pt"> </span>created<span style="letter-spacing:-0.85pt"> </span>using<span style="letter-spacing:-0.7pt"> </span>the<span style="letter-spacing:-0.45pt"> </span><strong>CREATE</strong><strong><span style="letter-spacing:-0.8pt"> </span></strong><strong>VIEW</strong><strong><span style="letter-spacing:-0.65pt"> </span></strong>statement.<span style="letter-spacing:-1pt"> </span>We<span style="letter-spacing:-0.7pt"> </span>can create a view from a single table or multiple tables.
			</p>
			<p style="margin-top:6.35pt; margin-left:7.15pt; margin-bottom:0pt; font-size:28pt">
				<span style="letter-spacing:-0.1pt">Syntax</span>
			</p>
			<p style="margin:4.4pt 393.25pt 0pt 43.75pt; text-align:justify; line-height:118%; font-size:20pt">
				CREATE VIEW view_name AS SELECT<span style="letter-spacing:-1.15pt"> </span>column1,<span style="letter-spacing:-1.15pt"> </span>column2..... FROM table_name
			</p>
			<p style="margin-top:0pt; margin-left:43.75pt; margin-bottom:0pt; line-height:24.4pt">
				<span style="font-size:20pt">WHERE</span><span style="font-size:20pt; letter-spacing:-0.4pt"> </span><span style="font-size:20pt; letter-spacing:-0.1pt">condition;</span>
			</p>
			<p style="margin-top:6.15pt; margin-left:7.15pt; margin-bottom:0pt; font-size:28pt">
				<span style="color:#ff0000">Creating</span><span style="letter-spacing:-1.1pt; color:#ff0000"> </span><span style="color:#ff0000">View</span><span style="letter-spacing:-1.05pt; color:#ff0000"> </span><span style="color:#ff0000">from</span><span style="letter-spacing:-0.9pt; color:#ff0000"> </span><span style="color:#ff0000">a</span><span style="letter-spacing:-1pt; color:#ff0000"> </span><span style="color:#ff0000">single</span><span style="letter-spacing:-0.9pt; color:#ff0000"> </span><span style="letter-spacing:-0.1pt; color:#ff0000">table</span>
			</p>
			<p style="margin:4.35pt 352.45pt 0pt 43.75pt; line-height:118%; font-size:20pt">
				CREATE<span style="letter-spacing:-1.15pt"> </span>VIEW<span style="letter-spacing:-1.15pt"> </span>DetailsView<span style="letter-spacing:-1.1pt"> </span>AS SELECT NAME, ADDRESS
			</p>
			<p style="margin:0pt 446.9pt 0pt 43.75pt; line-height:118%; font-size:20pt">
				FROM<span style="letter-spacing:-1.15pt"> </span>Student_Details WHERE STU_ID &lt; 4;
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">Creating</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-2pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">View</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.7pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">from</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.75pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">multiple</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.75pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">tables</span>
			</h2>
			<p style="margin:12.45pt 17.75pt 0pt 7.15pt; line-height:98%; font-size:24pt">
				View<span style="letter-spacing:-0.6pt"> </span>from<span style="letter-spacing:-0.55pt"> </span>multiple<span style="letter-spacing:-0.6pt"> </span>tables<span style="letter-spacing:-0.6pt"> </span>can<span style="letter-spacing:-0.5pt"> </span>be<span style="letter-spacing:-0.45pt"> </span>created<span style="letter-spacing:-0.6pt"> </span>by<span style="letter-spacing:-0.55pt"> </span>simply<span style="letter-spacing:-0.6pt"> </span>include multiple tables in the SELECT statement.
			</p>
			<p style="margin:5.95pt 53.45pt 0pt 7.15pt; line-height:98%; font-size:24pt">
				In<span style="letter-spacing:-0.65pt"> </span>the<span style="letter-spacing:-0.45pt"> </span>given<span style="letter-spacing:-0.5pt"> </span>example,<span style="letter-spacing:-0.65pt"> </span>a<span style="letter-spacing:-0.6pt"> </span>view<span style="letter-spacing:-0.5pt"> </span>is<span style="letter-spacing:-0.55pt"> </span>created<span style="letter-spacing:-0.65pt"> </span>named<span style="letter-spacing:-0.05pt"> </span>MarksView<span style="letter-spacing:-0.5pt"> </span>from two tables Student_Detail and Student_Marks.
			</p>
			<p style="margin-top:4.1pt; margin-bottom:0pt; font-size:24pt">
				&#xa0;
			</p>
			<p style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; font-size:20pt">
				CREATE<span style="letter-spacing:-1.15pt"> </span>VIEW<span style="letter-spacing:-1pt"> </span>MarksView<span style="letter-spacing:-0.7pt"> </span><span style="letter-spacing:-0.25pt">AS</span>
			</p>
			<p style="margin-top:4.4pt; margin-left:7.15pt; margin-bottom:0pt; line-height:118%; font-size:20pt">
				SELECT<span style="letter-spacing:-1.05pt"> </span>Student_Detail.NAME,<span style="letter-spacing:-0.8pt"> </span>Student_Detail.ADDRESS,<span style="letter-spacing:-1.05pt"> </span>Student_Marks.MARKS FROM Student_Detail, Student_Mark
			</p>
			<p style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:24.4pt">
				<span style="font-size:20pt">WHERE</span><span style="font-size:20pt; letter-spacing:-0.8pt"> </span><span style="font-size:20pt">Student_Detail.NAME</span><span style="font-size:20pt; letter-spacing:-0.45pt"> </span><span style="font-size:20pt">=</span><span style="font-size:20pt; letter-spacing:-0.35pt"> </span><span style="font-size:20pt; letter-spacing:-0.1pt">Student_Marks.NAME;</span>
			</p>
			<p style="margin-top:8.75pt; margin-bottom:0pt; font-size:20pt">
				&#xa0;
			</p>
			<p style="margin:0pt 415.3pt 0pt 7.15pt; line-height:156%; font-size:20pt">
				SELECT<span style="letter-spacing:-1pt"> </span>*<span style="letter-spacing:-0.85pt"> </span>FROM<span style="letter-spacing:-0.75pt"> </span>MarksView; DROP VIEW view_name;
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">SQL</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.8pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">Index</span>
			</h2>
			<p style="margin:12.45pt 16.1pt 0pt 43.75pt; text-indent:-36.6pt; text-align:justify; line-height:98%; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:28.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Indexes are special lookup tables. It is used to retrieve data from the database very fast.
			</p>
			<p style="margin:5.95pt 16pt 0pt 43.75pt; text-indent:-36.6pt; text-align:justify; line-height:98%; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:28.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>An Index is used to speed up select queries and where clauses. But it shows down the data input with insert and update statements. Indexes can be created or dropped without affecting the data.
			</p>
			<p style="margin:6.1pt 16.2pt 0pt 43.75pt; text-indent:-36.6pt; text-align:justify; line-height:98%; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:28.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>An index in a database is just like an index in the back of a <span style="letter-spacing:-0.1pt">book.</span>
			</p>
			<h3 style="margin-top:16.7pt; margin-left:7.15pt; margin-bottom:0pt; font-size:32pt">
				<span style="font-weight:normal; color:#ff0000">Create</span><span style="font-weight:normal; letter-spacing:-1.2pt; color:#ff0000"> </span><span style="font-weight:normal; color:#ff0000">Index</span><span style="font-weight:normal; letter-spacing:-0.65pt; color:#ff0000"> </span><span style="font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">statement</span>
			</h3>
			<p style="margin-top:8.2pt; margin-left:43.75pt; margin-bottom:0pt; font-size:28pt">
				<span style="letter-spacing:-0.2pt">CREATE</span><span style="letter-spacing:-1.25pt"> </span><span style="letter-spacing:-0.2pt">INDEX</span><span style="letter-spacing:-0.8pt"> </span><span style="letter-spacing:-0.2pt">index_name</span>
			</p>
			<p style="margin-top:6.15pt; margin-left:43.75pt; margin-bottom:0pt; font-size:28pt">
				ON<span style="letter-spacing:-1.45pt"> </span>table_name<span style="letter-spacing:-1.15pt"> </span>(column1,<span style="letter-spacing:-1.05pt"> </span>column2,<span style="letter-spacing:-1pt"> </span><span style="letter-spacing:-0.1pt">...);</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">Unique</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.85pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Index</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.5pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">statement</span>
			</h2>
			<h5 style="margin-top:12.1pt; margin-left:7.15pt; margin-bottom:0pt; font-size:20pt">
				<span style="letter-spacing:-0.1pt">Syntax</span>
			</h5>
		</div>
		<br style="clear:both; mso-break-type:section-break" >
		<div>
			<p style="margin-top:3.95pt; margin-bottom:0pt; font-size:20pt">
				<strong>&#xa0;</strong>
			</p>
			<p style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; font-size:20pt">
				n2,<span style="letter-spacing:-0.25pt"> </span><span style="letter-spacing:-0.1pt">...);</span>
			</p>
			<h5 style="margin-top:4.4pt; margin-left:7.15pt; margin-bottom:0pt; font-size:20pt">
				<span style="letter-spacing:-0.2pt">Example</span>
			</h5>
			<p style="margin-top:4.35pt; margin-bottom:0pt; font-size:20pt">
				<br style="clear:both; mso-column-break-before:always" >CREATE<span style="letter-spacing:-1.05pt"> </span>UNIQUE<span style="letter-spacing:-0.8pt"> </span>INDEX<span style="letter-spacing:-0.95pt"> </span><span style="letter-spacing:-0.1pt">index_name</span><span style="width:11.28pt; display:inline-block">&#xa0;</span>ON<span style="letter-spacing:-0.6pt"> </span>table_name<span style="letter-spacing:-0.15pt"> </span>(column1,<span style="letter-spacing:-0.35pt"> </span><span style="letter-spacing:-0.1pt">colum</span>
			</p>
			<p style="margin-top:0pt; margin-bottom:0pt; font-size:20pt">
				&#xa0;
			</p>
			<p style="margin-top:8.35pt; margin-bottom:0pt; font-size:20pt">
				&#xa0;
			</p>
			<p style="margin-top:0pt; margin-bottom:0pt; font-size:20pt">
				CREATE<span style="letter-spacing:-1pt"> </span>UNIQUE<span style="letter-spacing:-0.6pt"> </span>INDEX<span style="letter-spacing:-0.75pt"> </span>websites_idx<span style="letter-spacing:3.45pt"> </span>ON<span style="letter-spacing:-0.7pt"> </span>websites<span style="letter-spacing:-0.45pt"> </span><span style="letter-spacing:-0.1pt">(site_name);</span>
			</p>
		</div>
		<br style="clear:both; mso-break-type:section-break" >
		<div>
			<p style="margin-top:0pt; margin-bottom:0pt; font-size:28pt">
				&#xa0;
			</p>
			<p style="margin-top:18.4pt; margin-bottom:0pt; font-size:28pt">
				&#xa0;
			</p>
			<p style="margin-top:0.05pt; margin-left:7.15pt; margin-bottom:0pt; font-size:28pt">
				<span style="color:#ff0000">Drop</span><span style="letter-spacing:-1.15pt; color:#ff0000"> </span><span style="color:#ff0000">Index</span><span style="letter-spacing:-0.95pt; color:#ff0000"> </span><span style="letter-spacing:-0.1pt; color:#ff0000">Statement</span>
			</p>
			<h5 style="margin-top:4.4pt; margin-left:7.15pt; margin-bottom:0pt; font-size:20pt">
				<span style="letter-spacing:-0.1pt">Syntax</span>
			</h5>
		</div>
		<br style="clear:both; mso-break-type:section-break" >
		<div>
			<p style="margin-top:8.75pt; margin-bottom:0pt; font-size:20pt">
				<strong>&#xa0;</strong>
			</p>
			<p style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; font-size:20pt">
				<strong><span style="letter-spacing:-0.2pt">Example</span></strong>
			</p>
			<p style="margin-top:4.35pt; margin-right:338.3pt; margin-bottom:0pt; line-height:236%; font-size:20pt">
				<br style="clear:both; mso-column-break-before:always" >DROP INDEX index_name; DROP<span style="letter-spacing:-1.15pt"> </span>INDEX<span style="letter-spacing:-1.15pt"> </span>websites_idx;
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">SQL</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.8pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Sub</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.75pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">Query</span>
			</h2>
			<p style="margin-top:12.45pt; margin-left:7.15pt; margin-bottom:0pt; line-height:98%; font-size:24pt">
				A<span style="letter-spacing:-0.4pt"> </span>Subquery<span style="letter-spacing:-0.05pt"> </span>is<span style="letter-spacing:-0.25pt"> </span>a<span style="letter-spacing:-0.3pt"> </span>query<span style="letter-spacing:-0.15pt"> </span>within<span style="letter-spacing:-0.35pt"> </span>another<span style="letter-spacing:-0.2pt"> </span>SQL<span style="letter-spacing:-0.35pt"> </span>query<span style="letter-spacing:-0.15pt"> </span>and<span style="letter-spacing:-0.2pt"> </span>embedded within the WHERE clause.
			</p>
			<h4 style="margin-top:5.5pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				Important<span style="letter-spacing:-0.85pt"> </span><span style="letter-spacing:-0.1pt">Rule:</span>
			</h4>
			<p style="margin:4.75pt 42.4pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:20pt">
				<span style="font-family:Arial">•</span><span style="width:29.6pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>A<span style="letter-spacing:-0.3pt"> </span>subquery<span style="letter-spacing:-0.2pt"> </span>can<span style="letter-spacing:-0.2pt"> </span>be<span style="letter-spacing:-0.2pt"> </span>placed<span style="letter-spacing:-0.2pt"> </span>in<span style="letter-spacing:-0.1pt"> </span>a<span style="letter-spacing:-0.1pt"> </span>number<span style="letter-spacing:-0.25pt"> </span>of<span style="letter-spacing:-0.2pt"> </span>SQL<span style="letter-spacing:-0.15pt"> </span>clauses like<span style="letter-spacing:-0.1pt"> </span>WHERE<span style="letter-spacing:-0.4pt"> </span>clause, FROM clause, HAVING clause.
			</p>
			<p style="margin:4.95pt 50.8pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:20pt">
				<span style="font-family:Arial">•</span><span style="width:29.6pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>You<span style="letter-spacing:-1.15pt"> </span>can<span style="letter-spacing:-1.15pt"> </span>use<span style="letter-spacing:-1.1pt"> </span>Subquery<span style="letter-spacing:-1.15pt"> </span>with<span style="letter-spacing:-1.15pt"> </span>SELECT,<span style="letter-spacing:-1.1pt"> </span>UPDATE,<span style="letter-spacing:-1.15pt"> </span>INSERT,<span style="letter-spacing:-1.1pt"> </span>DELETE<span style="letter-spacing:-1.15pt"> </span>statements along with the operators like =, &lt;, &gt;, &gt;=, &lt;=, IN, BETWEEN, etc.
			</p>
			<p style="margin:4.95pt 42.75pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:20pt">
				<span style="font-family:Arial">•</span><span style="width:29.6pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>A<span style="letter-spacing:-0.35pt"> </span>subquery<span style="letter-spacing:-0.3pt"> </span>is<span style="letter-spacing:-0.1pt"> </span>a<span style="letter-spacing:-0.3pt"> </span>query<span style="letter-spacing:-0.35pt"> </span>within<span style="letter-spacing:-0.2pt"> </span>another<span style="letter-spacing:-0.3pt"> </span>query.<span style="letter-spacing:-0.4pt"> </span>The<span style="letter-spacing:-0.3pt"> </span>outer<span style="letter-spacing:-0.25pt"> </span>query<span style="letter-spacing:-0.35pt"> </span>is<span style="letter-spacing:-0.1pt"> </span>known<span style="letter-spacing:-0.35pt"> </span>as the main query, and the inner query is known as a subquery.
			</p>
			<p style="margin-top:4.55pt; margin-left:43.75pt; margin-bottom:0pt; text-indent:-36.6pt; font-size:20pt">
				<span style="font-family:Arial">•</span><span style="width:29.6pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Subqueries<span style="letter-spacing:-0.35pt"> </span>are<span style="letter-spacing:-0.2pt"> </span>on<span style="letter-spacing:-0.4pt"> </span>the<span style="letter-spacing:-0.15pt"> </span>right<span style="letter-spacing:-0.2pt"> </span>side<span style="letter-spacing:-0.2pt"> </span>of<span style="letter-spacing:-0.3pt"> </span>the<span style="letter-spacing:-0.2pt"> </span>comparison <span style="letter-spacing:-0.1pt">operator.</span>
			</p>
			<p style="margin-top:4.4pt; margin-left:43.75pt; margin-bottom:0pt; text-indent:-36.6pt; font-size:20pt">
				<span style="font-family:Arial">•</span><span style="width:29.6pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>A<span style="letter-spacing:-0.4pt"> </span>subquery<span style="letter-spacing:-0.2pt"> </span>is<span style="letter-spacing:0.05pt"> </span>enclosed<span style="letter-spacing:-0.2pt"> </span>in <span style="letter-spacing:-0.1pt">parentheses.</span>
			</p>
			<p style="margin:4.75pt 68.95pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:20pt">
				<span style="font-family:Arial; color:#ff0000">•</span><span style="width:29.6pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span><span style="color:#ff0000">In</span><span style="letter-spacing:-0.5pt; color:#ff0000"> </span><span style="color:#ff0000">the</span><span style="letter-spacing:-0.4pt; color:#ff0000"> </span><span style="color:#ff0000">Subquery,</span><span style="letter-spacing:-0.65pt; color:#ff0000"> </span><span style="color:#ff0000">ORDER</span><span style="letter-spacing:-0.65pt; color:#ff0000"> </span><span style="color:#ff0000">BY</span><span style="letter-spacing:-0.45pt; color:#ff0000"> </span><span style="color:#ff0000">command</span><span style="letter-spacing:-0.4pt; color:#ff0000"> </span><span style="color:#ff0000">cannot</span><span style="letter-spacing:-0.55pt; color:#ff0000"> </span><span style="color:#ff0000">be</span><span style="letter-spacing:-0.4pt; color:#ff0000"> </span><span style="color:#ff0000">used</span>.<span style="letter-spacing:-0.4pt"> </span>But<span style="letter-spacing:-0.35pt"> </span><strong><span style="color:#0070bf">GROUP</span></strong><strong><span style="letter-spacing:-0.5pt; color:#0070bf"> </span></strong><strong><span style="color:#0070bf">BY command can be used </span></strong>to perform the same function as ORDER BY <span style="letter-spacing:-0.1pt">command.</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">Subqueries</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.3pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">with</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.3pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">the</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.45pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Select</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.45pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">Statement</span>
			</h2>
			<p style="margin-top:12pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				SQL<span style="letter-spacing:-0.65pt"> </span>subqueries<span style="letter-spacing:-0.1pt"> </span>are<span style="letter-spacing:-0.3pt"> </span>most<span style="letter-spacing:-0.55pt"> </span>frequently<span style="letter-spacing:-0.2pt"> </span>used<span style="letter-spacing:-0.3pt"> </span>with<span style="letter-spacing:-0.45pt"> </span>the<span style="letter-spacing:0.05pt"> </span>Select<span style="letter-spacing:-0.55pt"> </span><span style="letter-spacing:-0.1pt">statement.</span>
			</p>
			<h4 style="margin-top:5.25pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Syntax:</span>
			</h4>
			<p style="margin:4.4pt 446.9pt 0pt 43.15pt; line-height:118%; font-size:20pt">
				SELECT<span style="letter-spacing:-1.15pt"> </span>column_name FROM table_name
			</p>
			<p style="margin-top:0pt; margin-left:43.15pt; margin-bottom:0pt; line-height:24.4pt">
				<span style="font-size:20pt">WHERE</span><span style="font-size:20pt; letter-spacing:-0.95pt"> </span><span style="font-size:20pt">column_name</span><span style="font-size:20pt; letter-spacing:-0.6pt"> </span><span style="font-size:20pt">expression</span><span style="font-size:20pt; letter-spacing:-0.35pt"> </span><span style="font-size:20pt; letter-spacing:-0.1pt">operator</span>
			</p>
			<p style="margin-top:4.4pt; margin-left:43.15pt; margin-bottom:0pt; font-size:20pt">
				(<span style="letter-spacing:-0.3pt"> </span>SELECT<span style="letter-spacing:-0.6pt"> </span>column_name<span style="letter-spacing:1.75pt"> </span>from<span style="letter-spacing:-0.25pt"> </span>table_name<span style="letter-spacing:-0.05pt"> </span>WHERE<span style="letter-spacing:-0.55pt"> </span>...<span style="letter-spacing:-0.4pt"> </span><span style="letter-spacing:-0.25pt">);</span>
			</p>
			<p style="margin-top:8.75pt; margin-bottom:0pt; font-size:20pt">
				&#xa0;
			</p>
			<h5 style="margin-top:0pt; margin-left:7.65pt; margin-bottom:0pt; font-size:20pt">
				<span style="letter-spacing:-0.1pt">Example:</span>
			</h5>
			<p style="margin-top:4.4pt; margin-left:39.1pt; margin-bottom:0pt; font-size:20pt">
				SELECT<span style="letter-spacing:-0.65pt"> </span><span style="letter-spacing:-0.5pt">*</span>
			</p>
			<p style="margin:4.4pt 415.3pt 0pt 57pt; line-height:118%; font-size:20pt">
				FROM EMPLOYEE WHERE ID IN (SELECT ID FROM EMPLOYEE WHERE<span style="letter-spacing:-0.75pt"> </span>SALARY<span style="letter-spacing:-0.75pt"> </span>&gt;<span style="letter-spacing:-0.55pt"> </span>4500);
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:19.45pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="height:0pt; display:block; position:absolute; z-index:-16"><img src="data:image/png;base64," width="960" height="360" alt="" style="margin-top:240pt; margin-left:-49.45pt; position:absolute" ></span><span style="font-size:40pt; font-weight:normal; color:#ff0000">Subqueries</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.4pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">with</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.4pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">the</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.55pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">INSERT</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.25pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">Statement</span>
			</h2>
			<p style="margin:12.45pt 31.05pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:20pt">
				<span style="font-family:Arial">•</span><span style="width:29.6pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>SQL subquery can also be used with the Insert statement. In the insert statement,<span style="letter-spacing:-0.25pt"> </span>data<span style="letter-spacing:-0.3pt"> </span>returned<span style="letter-spacing:-0.45pt"> </span>from<span style="letter-spacing:-0.4pt"> </span>the<span style="letter-spacing:-0.15pt"> </span>subquery<span style="letter-spacing:-0.55pt"> </span>is<span style="letter-spacing:-0.3pt"> </span>used<span style="letter-spacing:-0.45pt"> </span>to<span style="letter-spacing:-0.35pt"> </span>insert<span style="letter-spacing:-0.3pt"> </span>into<span style="letter-spacing:-0.35pt"> </span>another <span style="letter-spacing:-0.1pt">table.</span>
			</p>
			<p style="margin:5.05pt 93.25pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:20pt">
				<span style="font-family:Arial">•</span><span style="width:29.6pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>In<span style="letter-spacing:-0.5pt"> </span>the<span style="letter-spacing:-0.35pt"> </span>subquery,<span style="letter-spacing:-0.5pt"> </span>the<span style="letter-spacing:-0.4pt"> </span>selected<span style="letter-spacing:-0.05pt"> </span>data<span style="letter-spacing:-0.3pt"> </span>can<span style="letter-spacing:-0.5pt"> </span>be<span style="letter-spacing:-0.3pt"> </span>modified<span style="letter-spacing:-0.3pt"> </span>with<span style="letter-spacing:-0.4pt"> </span>any<span style="letter-spacing:-0.5pt"> </span>of<span style="letter-spacing:-0.4pt"> </span>the character, date functions.
			</p>
			<h4 style="margin-top:5.4pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Syntax:</span>
			</h4>
			<p style="margin-top:4.4pt; margin-left:43.75pt; margin-bottom:0pt; font-size:20pt">
				INSERT<span style="letter-spacing:-0.85pt"> </span>INTO<span style="letter-spacing:-0.6pt"> </span>table_name<span style="letter-spacing:-0.25pt"> </span>(column1,<span style="letter-spacing:-0.55pt"> </span>column2,<span style="letter-spacing:-0.65pt"> </span><span style="letter-spacing:-0.1pt">column3</span><span style="width:19.03pt; font-family:'Lucida Console'; font-size:10pt; display:inline-block">...</span><span style="letter-spacing:-0.5pt">)</span>
			</p>
			<p style="margin-top:4.4pt; margin-left:79.15pt; margin-bottom:0pt; font-size:20pt">
				<strong>SELECT</strong><strong><span style="letter-spacing:-0.3pt"> </span></strong>*<span style="letter-spacing:1.95pt"> </span><strong>FROM</strong><strong><span style="letter-spacing:-0.35pt"> </span></strong><span style="letter-spacing:-0.1pt">table_name</span><span style="width:17.61pt; display:inline-block">&#xa0;</span><strong>WHERE</strong><strong><span style="letter-spacing:-1.05pt"> </span></strong>VALUE<span style="letter-spacing:-0.95pt"> </span><span style="letter-spacing:-0.1pt">OPERATOR</span>
			</p>
			<p style="margin-top:8.75pt; margin-bottom:0pt; font-size:20pt">
				&#xa0;
			</p>
			<h5 style="margin-top:0pt; margin-left:7.65pt; margin-bottom:0pt; font-size:20pt">
				<span style="letter-spacing:-0.1pt">Example:</span>
			</h5>
			<p style="margin:4.4pt 352.45pt 0pt 79.15pt; text-indent:-35.4pt; line-height:118%; font-size:20pt">
				INSERT INTO EMPLOYEE_BKP SELECT<span style="letter-spacing:-1.15pt"> </span>*<span style="letter-spacing:-1pt"> </span>FROM<span style="letter-spacing:-0.95pt"> </span>EMPLOYEE WHERE ID IN (SELECT ID FROM EMPLOYEE);
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; text-align:justify; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">Subqueries</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-2.3pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">with</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-2.25pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">the</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-2.25pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">UPDATE</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-2.25pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">Statement</span>
			</h2>
			<p style="margin:12.45pt 38.25pt 0pt 7.15pt; text-align:justify; line-height:98%; font-size:24pt">
				The<span style="letter-spacing:-0.25pt"> </span>subquery<span style="letter-spacing:-0.2pt"> </span>of<span style="letter-spacing:-0.2pt"> </span>SQL<span style="letter-spacing:-0.45pt"> </span>can<span style="letter-spacing:-0.45pt"> </span>be<span style="letter-spacing:-0.25pt"> </span>used<span style="letter-spacing:-0.2pt"> </span>in<span style="letter-spacing:-0.45pt"> </span>conjunction<span style="letter-spacing:-0.3pt"> </span>with<span style="letter-spacing:-0.45pt"> </span>the<span style="letter-spacing:-0.25pt"> </span>Update statement.<span style="letter-spacing:-0.9pt"> </span>When<span style="letter-spacing:-0.45pt"> </span>a<span style="letter-spacing:-0.55pt"> </span>subquery<span style="letter-spacing:-0.45pt"> </span>is<span style="letter-spacing:-0.6pt"> </span>used<span style="letter-spacing:-0.55pt"> </span>with<span style="letter-spacing:-0.7pt"> </span>the<span style="letter-spacing:-0.5pt"> </span>Update<span style="letter-spacing:-0.5pt"> </span>statement, then<span style="letter-spacing:-0.3pt"> </span>either<span style="letter-spacing:-0.25pt"> </span>single<span style="letter-spacing:-0.1pt"> </span>or<span style="letter-spacing:-0.15pt"> </span>multiple<span style="letter-spacing:-0.35pt"> </span>columns<span style="letter-spacing:-0.2pt"> </span>in<span style="letter-spacing:-0.15pt"> </span>a<span style="letter-spacing:-0.25pt"> </span>table<span style="letter-spacing:-0.25pt"> </span>can<span style="letter-spacing:-0.15pt"> </span>be<span style="letter-spacing:-0.1pt"> </span>updated.
			</p>
			<h4 style="margin-top:5.55pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Syntax:</span>
			</h4>
			<h5 style="margin:4.4pt 19.95pt 0pt 79.15pt; text-indent:-35.4pt; line-height:118%; font-size:20pt">
				UPDATE table<span style="width:11.02pt; text-indent:0pt; display:inline-block">&#xa0;</span>SET<span style="letter-spacing:-0.85pt"> </span>column_name<span style="letter-spacing:-0.9pt"> </span>=<span style="letter-spacing:-0.8pt"> </span>new_value<span style="letter-spacing:2.9pt"> </span>WHERE<span style="letter-spacing:-0.8pt"> </span>VALUE<span style="letter-spacing:-0.9pt"> </span>OPERATOR (SELECT COLUMN_NAME              FROM TABLE_NAME<span style="letter-spacing:2pt"> </span>WHERE condition);
			</h5>
			<p style="margin-top:0pt; margin-left:7.65pt; margin-bottom:0pt; line-height:24.4pt">
				<strong><span style="font-size:20pt; letter-spacing:-0.1pt">Example:</span></strong>
			</p>
			<p style="margin-top:4.8pt; margin-left:7.65pt; margin-bottom:0pt; line-height:98%; font-size:20pt">
				Let's assume we have an EMPLOYEE_BKP<span style="letter-spacing:-0.3pt"> </span>table available which is backup of EMPLOYEE<span style="letter-spacing:-0.7pt"> </span>table.<span style="letter-spacing:-0.35pt"> </span>The<span style="letter-spacing:-0.45pt"> </span>given<span style="letter-spacing:-0.35pt"> </span>example<span style="letter-spacing:-0.25pt"> </span>updates<span style="letter-spacing:-0.35pt"> </span>the<span style="letter-spacing:-0.45pt"> </span>SALARY<span style="letter-spacing:-0.5pt"> </span>by<span style="letter-spacing:-0.55pt"> </span>.25<span style="letter-spacing:-0.55pt"> </span>times<span style="letter-spacing:-0.25pt"> </span>in<span style="letter-spacing:-0.35pt"> </span>the EMPLOYEE<span style="letter-spacing:-0.3pt"> </span>table for<span style="letter-spacing:-0.05pt"> </span>all employee whose AGE is greater than or<span style="letter-spacing:-0.05pt"> </span>equal<span style="letter-spacing:-0.05pt"> </span>to 29.
			</p>
			<p style="margin-top:4.6pt; margin-left:47.35pt; margin-bottom:0pt; font-size:20pt">
				<strong><span style="letter-spacing:-0.35pt">UPDATE</span></strong><strong><span style="letter-spacing:-0.55pt"> </span></strong><strong><span style="letter-spacing:-0.1pt">EMPLOYEE</span></strong>
			</p>
			<p style="margin-top:4.4pt; margin-left:83.5pt; margin-bottom:0pt; font-size:20pt">
				<strong>SET</strong><strong><span style="letter-spacing:-0.35pt"> </span></strong><strong>SALARY</strong><strong><span style="letter-spacing:-0.45pt"> </span></strong><strong>=</strong><strong><span style="letter-spacing:-0.3pt"> </span></strong><strong>SALARY</strong><strong><span style="letter-spacing:-0.35pt"> </span></strong><strong>*</strong><strong><span style="letter-spacing:-0.3pt"> </span></strong><strong><span style="letter-spacing:-0.2pt">0.25</span></strong>
			</p>
			<p style="margin:4.4pt 53.45pt 0pt 223.15pt; text-indent:-67.7pt; line-height:118%; font-size:20pt">
				<strong>WHERE</strong><strong><span style="letter-spacing:-0.55pt"> </span></strong><strong>AGE</strong><strong><span style="letter-spacing:-0.6pt"> </span></strong><strong>IN</strong><strong><span style="letter-spacing:-0.65pt"> </span></strong><strong>(SELECT</strong><strong><span style="letter-spacing:-0.55pt"> </span></strong><strong>AGE</strong><strong><span style="letter-spacing:-0.6pt"> </span></strong><strong>FROM</strong><strong><span style="letter-spacing:-0.7pt"> </span></strong><strong>CUSTOMERS_BKP WHERE AGE &gt;= 29);</strong>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h2 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">Subqueries</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.3pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">with</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.35pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">the</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.25pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; color:#ff0000">DELETE</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.3pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">Statement</span>
			</h2>
			<p style="margin-top:12.45pt; margin-left:7.15pt; margin-bottom:0pt; line-height:98%; font-size:24pt">
				The<span style="letter-spacing:-0.25pt"> </span>subquery<span style="letter-spacing:-0.2pt"> </span>of<span style="letter-spacing:-0.2pt"> </span>SQL<span style="letter-spacing:-0.45pt"> </span>can<span style="letter-spacing:-0.45pt"> </span>be<span style="letter-spacing:-0.25pt"> </span>used<span style="letter-spacing:-0.2pt"> </span>in<span style="letter-spacing:-0.45pt"> </span>conjunction<span style="letter-spacing:-0.3pt"> </span>with<span style="letter-spacing:-0.45pt"> </span>the<span style="letter-spacing:-0.25pt"> </span>Delete statement<span style="letter-spacing:-0.1pt"> </span>just like any other statements mentioned above.
			</p>
			<h4 style="margin-top:5.5pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Syntax:</span>
			</h4>
			<p style="margin-top:4.35pt; margin-left:39.1pt; margin-bottom:0pt; font-size:20pt">
				<strong>DELETE</strong><strong><span style="letter-spacing:-0.4pt"> </span></strong><strong>FROM</strong><strong><span style="letter-spacing:-0.4pt"> </span></strong><strong><span style="letter-spacing:-0.1pt">TABLE_NAME</span></strong><strong><span style="width:11.59pt; display:inline-block">&#xa0;</span></strong><strong>WHERE</strong><strong><span style="letter-spacing:-1.1pt"> </span></strong><strong>VALUE</strong><strong><span style="letter-spacing:-1.05pt"> </span></strong><strong><span style="letter-spacing:-0.1pt">OPERATOR</span></strong>
			</p>
			<h5 style="margin-top:4.4pt; margin-left:83.5pt; margin-bottom:0pt; font-size:20pt">
				(SELECT<span style="letter-spacing:-0.45pt"> </span>COLUMN_NAME<span style="letter-spacing:3.3pt"> </span>FROM<span style="letter-spacing:-0.55pt"> </span><span style="letter-spacing:-0.1pt">TABLE_NAME</span><span style="width:15.44pt; display:inline-block">&#xa0;</span>WHERE<span style="letter-spacing:-0.4pt"> </span><span style="letter-spacing:-0.1pt">condition);</span>
			</h5>
			<p style="margin-top:4.4pt; margin-left:7.65pt; margin-bottom:0pt; font-size:20pt">
				<strong><span style="letter-spacing:-0.1pt">Example:</span></strong>
			</p>
			<p style="margin:4.75pt 17.75pt 0pt 7.65pt; line-height:98%; font-size:20pt">
				Let's assume we have an EMPLOYEE_BKP<span style="letter-spacing:-0.15pt"> </span>table available which is backup of EMPLOYEE<span style="letter-spacing:-0.9pt"> </span>table.<span style="letter-spacing:-0.55pt"> </span>The<span style="letter-spacing:-0.65pt"> </span>given<span style="letter-spacing:-0.55pt"> </span>example<span style="letter-spacing:-0.45pt"> </span>deletes<span style="letter-spacing:-0.4pt"> </span>the<span style="letter-spacing:-0.65pt"> </span>records<span style="letter-spacing:-0.65pt"> </span>from<span style="letter-spacing:-0.6pt"> </span>the<span style="letter-spacing:-0.55pt"> </span>EMPLOYEE table for all EMPLOYEE whose AGE is greater than or equal to 29.
			</p>
			<p style="margin-top:9.05pt; margin-bottom:0pt; font-size:20pt">
				&#xa0;
			</p>
			<p style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; font-size:20pt">
				<strong>DELETE</strong><strong><span style="letter-spacing:-0.4pt"> </span></strong><strong>FROM</strong><strong><span style="letter-spacing:-0.4pt"> </span></strong><strong><span style="letter-spacing:-0.1pt">EMPLOYEE</span></strong>
			</p>
			<p style="margin:4.35pt 186.75pt 0pt 34.05pt; text-indent:-13.6pt; line-height:118%; font-size:20pt">
				<strong>WHERE</strong><strong><span style="letter-spacing:-0.6pt"> </span></strong><strong>AGE</strong><strong><span style="letter-spacing:-0.65pt"> </span></strong><strong>IN</strong><strong><span style="letter-spacing:-0.65pt"> </span></strong><strong>(SELECT</strong><strong><span style="letter-spacing:-0.6pt"> </span></strong><strong>AGE</strong><strong><span style="letter-spacing:-0.65pt"> </span></strong><strong>FROM</strong><strong><span style="letter-spacing:-0.7pt"> </span></strong><strong>EMPLOYEE_BKP WHERE AGE &gt;= 29 );</strong>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<p style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; color:#ff0000">SQL</span><span style="font-size:40pt; letter-spacing:-0.8pt; color:#ff0000"> </span><span style="font-size:40pt; letter-spacing:-0.1pt; color:#ff0000">Clauses</span>
			</p>
			<p style="margin-top:1.4pt; margin-bottom:0pt; font-size:10pt">
				<img src="data:image/png;base64," width="807" height="488" alt="" ><br >
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">GROUP</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.75pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.25pt; color:#ff0000">BY</span>
			</h1>
			<p style="margin:12.45pt 24.6pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:28.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>SQL<span style="letter-spacing:-0.9pt"> </span>GROUP<span style="letter-spacing:-0.75pt"> </span>BY<span style="letter-spacing:-0.75pt"> </span>statement<span style="letter-spacing:-0.9pt"> </span>is<span style="letter-spacing:-0.75pt"> </span>used<span style="letter-spacing:-0.7pt"> </span>to<span style="letter-spacing:-0.75pt"> </span>arrange<span style="letter-spacing:-0.8pt"> </span>identical<span style="letter-spacing:-0.85pt"> </span>data<span style="letter-spacing:-0.8pt"> </span>into <span style="letter-spacing:-0.1pt">groups.</span>
			</p>
			<p style="margin:5.95pt 108.2pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:28.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>The<span style="letter-spacing:-0.45pt"> </span>GROUP<span style="letter-spacing:-0.55pt"> </span>BY<span style="letter-spacing:-0.55pt"> </span>statement<span style="letter-spacing:-0.75pt"> </span>is<span style="letter-spacing:-0.55pt"> </span>used<span style="letter-spacing:-0.5pt"> </span>with<span style="letter-spacing:-0.65pt"> </span>the<span style="letter-spacing:-0.45pt"> </span>SQL<span style="letter-spacing:-0.65pt"> </span>SELECT <span style="letter-spacing:-0.1pt">statement.</span>
			</p>
			<p style="margin:5.9pt 86.35pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:28.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>The<span style="letter-spacing:-0.55pt"> </span>GROUP<span style="letter-spacing:-0.65pt"> </span>BY<span style="letter-spacing:-0.65pt"> </span>statement<span style="letter-spacing:-0.85pt"> </span>follows<span style="letter-spacing:-0.65pt"> </span>the<span style="letter-spacing:-0.55pt"> </span>WHERE<span style="letter-spacing:-0.7pt"> </span>clause<span style="letter-spacing:-0.7pt"> </span>in<span style="letter-spacing:-0.6pt"> </span>a SELECT statement and precedes the ORDER BY clause.
			</p>
			<p style="margin-top:5.5pt; margin-left:43.75pt; margin-bottom:0pt; text-indent:-36.6pt; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:28.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>The<span style="letter-spacing:-0.65pt"> </span>GROUP<span style="letter-spacing:-0.6pt"> </span>BY<span style="letter-spacing:-0.65pt"> </span>statement<span style="letter-spacing:-0.8pt"> </span>is<span style="letter-spacing:-0.6pt"> </span>used<span style="letter-spacing:-0.55pt"> </span>with<span style="letter-spacing:-0.7pt"> </span>aggregation<span style="letter-spacing:-0.7pt"> </span><span style="letter-spacing:-0.1pt">function.</span>
			</p>
			<p style="margin-top:0.55pt; margin-bottom:0pt; font-size:6.5pt">
				&#xa0;
			</p>
		</div>
		<br style="clear:both; mso-break-type:section-break" >
		<div>
			<h4 style="margin-top:0.15pt; margin-left:31.15pt; margin-bottom:0pt; line-height:29.05pt">
				<span style="height:0pt; margin-top:-0.15pt; display:block; position:absolute; z-index:-15"><img src="data:image/png;base64," width="960" height="360" alt="" style="margin-top:-44.9pt; margin-left:-61.15pt; position:absolute" ></span><span style="font-size:24pt; letter-spacing:-0.1pt">Syntax</span>
			</h4>
			<p style="margin:0.2pt 1.7pt 0pt 71.35pt; line-height:98%; font-size:24pt">
				SELECT column FROM<span style="letter-spacing:-1.4pt"> </span>table_name WHERE conditions GROUP<span style="letter-spacing:-0.1pt"> </span>BY column ORDER BY column
			</p>
			<h4 style="margin-top:0.15pt; margin-left:31.15pt; margin-bottom:0pt; font-size:24pt">
				<br style="clear:both; mso-column-break-before:always" ><span style="letter-spacing:-0.1pt">Example</span>
			</h4>
			<p style="margin:28.75pt 68.5pt 0pt 31.15pt; line-height:98%; font-size:20pt">
				<span style="letter-spacing:-0.2pt">SELECT</span><span style="letter-spacing:-0.9pt"> </span><span style="letter-spacing:-0.2pt">COMPANY,</span><span style="letter-spacing:-0.9pt"> </span><span style="letter-spacing:-0.2pt">COUNT(*) </span>FROM PRODUCT_MAST GROUP BY COMPANY;
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">HAVING</span>
			</h1>
			<p style="margin:12.45pt 19.8pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:28.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>HAVING<span style="letter-spacing:-0.65pt"> </span>clause<span style="letter-spacing:-0.45pt"> </span>is<span style="letter-spacing:-0.65pt"> </span>used<span style="letter-spacing:-0.4pt"> </span>to<span style="letter-spacing:-0.65pt"> </span>specify<span style="letter-spacing:-0.45pt"> </span>a<span style="letter-spacing:-0.6pt"> </span>search<span style="letter-spacing:-0.5pt"> </span>condition<span style="letter-spacing:-0.5pt"> </span>for<span style="letter-spacing:-0.5pt"> </span>a<span style="letter-spacing:-0.6pt"> </span>group or an aggregate.
			</p>
			<p style="margin:5.95pt 67.85pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:28.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Having is used in a GROUP BY clause. If you are not using GROUP<span style="letter-spacing:-0.7pt"> </span>BY<span style="letter-spacing:-0.65pt"> </span>clause<span style="letter-spacing:-0.7pt"> </span>then<span style="letter-spacing:-0.6pt"> </span>you<span style="letter-spacing:-0.6pt"> </span>can<span style="letter-spacing:-0.7pt"> </span>use<span style="letter-spacing:-0.55pt"> </span>HAVING<span style="letter-spacing:-0.5pt"> </span>function<span style="letter-spacing:-0.6pt"> </span>like<span style="letter-spacing:-0.75pt"> </span>a WHERE clause
			</p>
			<p style="margin-top:5.65pt; margin-bottom:0pt; font-size:10pt">
				&#xa0;
			</p>
		</div>
		<br style="clear:both; mso-break-type:section-break" >
		<div>
			<h4 style="margin-top:0.2pt; margin-left:25.15pt; margin-bottom:0pt; line-height:29.1pt">
				<span style="font-size:24pt; letter-spacing:-0.1pt">Syntax</span>
			</h4>
			<p style="margin-top:0.15pt; margin-left:42.95pt; margin-bottom:0pt; line-height:98%; font-size:20pt">
				SELECT<span style="letter-spacing:-0.8pt"> </span>column1,<span style="letter-spacing:-0.75pt"> </span>column2<span style="letter-spacing:2pt"> </span>FRO M table_name
			</p>
			<p style="margin-top:0pt; margin-left:42.95pt; margin-bottom:0pt; line-height:23.95pt">
				<span style="font-size:20pt">WHERE</span><span style="font-size:20pt; letter-spacing:-0.4pt"> </span><span style="font-size:20pt; letter-spacing:-0.1pt">conditions</span>
			</p>
			<p style="margin-top:0.2pt; margin-left:42.95pt; margin-bottom:0pt; line-height:98%; font-size:20pt">
				GROUP<span style="letter-spacing:-0.95pt"> </span>BY<span style="letter-spacing:-0.9pt"> </span>column1,<span style="letter-spacing:-1.05pt"> </span>column2 HAVING conditions
			</p>
			<p style="margin-top:0pt; margin-left:42.95pt; margin-bottom:0pt; line-height:24.2pt">
				<span style="font-size:20pt">ORDER</span><span style="font-size:20pt; letter-spacing:-0.75pt"> </span><span style="font-size:20pt">BY</span><span style="font-size:20pt; letter-spacing:-0.35pt"> </span><span style="font-size:20pt">column1,</span><span style="font-size:20pt; letter-spacing:-0.4pt"> </span><span style="font-size:20pt; letter-spacing:-0.1pt">column2;</span>
			</p>
			<h4 style="margin-top:12.2pt; margin-left:25.15pt; margin-bottom:0pt; line-height:29.1pt">
				<br style="clear:both; mso-column-break-before:always" ><span style="font-size:24pt; letter-spacing:-0.1pt">Example</span>
			</h4>
			<p style="margin:0.15pt 67.75pt 0pt 25.15pt; line-height:98%; font-size:20pt">
				<span style="letter-spacing:-0.2pt">SELECT</span><span style="letter-spacing:-0.9pt"> </span><span style="letter-spacing:-0.2pt">COMPANY,</span><span style="letter-spacing:-0.9pt"> </span><span style="letter-spacing:-0.2pt">COUNT(*) </span>FROM PRODUCT_MAST GROUP BY COMPANY HAVING COUNT(*)&gt;2;
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">ORDER</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.4pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.25pt; color:#ff0000">BY</span>
			</h1>
			<p style="margin:12.45pt 83.7pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:28.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>The<span style="letter-spacing:-0.35pt"> </span>ORDER<span style="letter-spacing:-0.55pt"> </span>BY<span style="letter-spacing:-0.35pt"> </span>clause<span style="letter-spacing:-0.5pt"> </span>sorts<span style="letter-spacing:-0.45pt"> </span>the<span style="letter-spacing:-0.35pt"> </span>result-set<span style="letter-spacing:-0.5pt"> </span>in<span style="letter-spacing:-0.4pt"> </span>ascending<span style="letter-spacing:-0.4pt"> </span>or descending order.
			</p>
			<p style="margin:5.95pt 88pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:28.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>It sorts the records in ascending order by default. DESC keyword<span style="letter-spacing:-1.1pt"> </span>is<span style="letter-spacing:-0.85pt"> </span>used<span style="letter-spacing:-0.7pt"> </span>to<span style="letter-spacing:-0.95pt"> </span>sort<span style="letter-spacing:-0.8pt"> </span>the<span style="letter-spacing:-0.9pt"> </span>records<span style="letter-spacing:-0.75pt"> </span>in<span style="letter-spacing:-0.8pt"> </span>descending<span style="letter-spacing:-0.9pt"> </span>order.
			</p>
			<p style="margin-top:0pt; margin-bottom:0pt; font-size:10pt">
				&#xa0;
			</p>
			<p style="margin-top:4.2pt; margin-bottom:0pt; font-size:10pt">
				&#xa0;
			</p>
		</div>
		<br style="clear:both; mso-break-type:section-break" >
		<div>
			<h4 style="margin-top:18.15pt; margin-left:25.15pt; margin-bottom:0pt; line-height:29.1pt">
				<span style="font-size:24pt; letter-spacing:-0.1pt">Syntax</span>
			</h4>
			<p style="margin:0.15pt 66.25pt 0pt 25.15pt; line-height:98%; font-size:20pt">
				SELECT<span style="letter-spacing:-1.15pt"> </span>column1,<span style="letter-spacing:-1.15pt"> </span>column2 FROM table_name WHERE condition
			</p>
			<p style="margin-top:0.25pt; margin-left:25.15pt; margin-bottom:0pt; line-height:98%; font-size:20pt">
				ORDER<span style="letter-spacing:-0.95pt"> </span>BY<span style="letter-spacing:-0.6pt"> </span>column1,<span style="letter-spacing:-0.65pt"> </span>column2...<span style="letter-spacing:-0.95pt"> </span>AS <span style="letter-spacing:-0.1pt">C|DESC;</span>
			</p>
			<h4 style="margin-top:0.15pt; margin-left:25.15pt; margin-bottom:0pt; line-height:29.05pt">
				<br style="clear:both; mso-column-break-before:always" ><span style="font-size:24pt; letter-spacing:-0.1pt">Example</span>
			</h4>
			<p style="margin-top:0pt; margin-left:25.15pt; margin-bottom:0pt; text-align:justify; line-height:28.8pt">
				<span style="font-size:24pt">SELECT</span><span style="font-size:24pt; letter-spacing:-0.5pt"> *</span>
			</p>
			<p style="margin:0.2pt 125.15pt 0pt 25.15pt; text-align:justify; line-height:98%; font-size:24pt">
				<span style="letter-spacing:-0.1pt">FROM</span><span style="letter-spacing:-1.3pt"> </span><span style="letter-spacing:-0.1pt">CUSTOMER </span>ORDER BY NAME; <span style="letter-spacing:-0.3pt; color:#ff0000">OR</span>
			</p>
			<p style="margin-top:0pt; margin-left:25.15pt; margin-bottom:0pt; text-align:justify; line-height:28.85pt">
				<span style="font-size:24pt">SELECT</span><span style="font-size:24pt; letter-spacing:-0.5pt"> *</span>
			</p>
			<p style="margin:0.2pt 75.1pt 0pt 25.15pt; text-align:justify; line-height:98%; font-size:24pt">
				FROM CUSTOMER ORDER<span style="letter-spacing:-0.55pt"> </span>BY<span style="letter-spacing:-0.4pt"> </span>NAME<span style="letter-spacing:-0.4pt"> </span><span style="letter-spacing:-0.2pt">DESC;</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<p style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; letter-spacing:-0.1pt; color:#ff0000">SQL</span><span style="font-size:40pt; letter-spacing:-1.65pt; color:#ff0000"> </span><span style="font-size:40pt; letter-spacing:-0.1pt; color:#ff0000">Aggregate</span><span style="font-size:40pt; letter-spacing:-1.7pt; color:#ff0000"> </span><span style="font-size:40pt; letter-spacing:-0.1pt; color:#ff0000">Functions</span>
			</p>
			<p style="margin-top:0.25pt; margin-bottom:0pt; font-size:6pt">
				<img src="data:image/png;base64," width="845" height="455" alt="" ><br >
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">COUNT</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.55pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">FUNCTION</span>
			</h1>
			<p style="margin:12.5pt 33.1pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:22pt">
				<span style="font-family:Arial">•</span><span style="width:28.9pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>COUNT<span style="letter-spacing:-0.15pt"> </span>function<span style="letter-spacing:-0.5pt"> </span>is<span style="letter-spacing:-0.35pt"> </span>used<span style="letter-spacing:-0.5pt"> </span>to<span style="letter-spacing:-0.2pt"> </span>Count<span style="letter-spacing:-0.4pt"> </span>the<span style="letter-spacing:-0.4pt"> </span>number<span style="letter-spacing:-0.35pt"> </span>of<span style="letter-spacing:-0.35pt"> </span>rows<span style="letter-spacing:-0.35pt"> </span>in<span style="letter-spacing:-0.5pt"> </span>a<span style="letter-spacing:-0.45pt"> </span>database table. It can work on both numeric and non-numeric data types.
			</p>
			<p style="margin:5.45pt 26.65pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:22pt">
				<span style="font-family:Arial">•</span><span style="width:28.9pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>COUNT<span style="letter-spacing:-0.2pt"> </span>function<span style="letter-spacing:-0.5pt"> </span>uses<span style="letter-spacing:-0.4pt"> </span>the<span style="letter-spacing:-0.3pt"> </span>COUNT(*) that<span style="letter-spacing:-0.45pt"> </span>returns<span style="letter-spacing:-0.5pt"> </span>the<span style="letter-spacing:-0.3pt"> </span>count<span style="letter-spacing:-0.45pt"> </span>of<span style="letter-spacing:-0.4pt"> </span>all<span style="letter-spacing:-0.5pt"> </span>the rows in a specified table. COUNT(*) considers duplicate and Null.
			</p>
			<h4 style="margin-top:5.4pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Syntax</span>
			</h4>
			<p style="margin-top:9.1pt; margin-left:43.75pt; margin-bottom:0pt; font-size:20pt">
				COUNT(*)<span style="letter-spacing:3.55pt"> </span>or<span style="letter-spacing:3.8pt"> </span>COUNT(<span style="letter-spacing:-0.6pt"> </span>[ALL|DISTINCT]<span style="letter-spacing:-0.5pt"> </span>expression<span style="letter-spacing:-0.15pt"> </span><span style="letter-spacing:-0.5pt">)</span>
			</p>
			<h4 style="margin-top:6.3pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Example</span>
			</h4>
			<p style="margin-top:4.4pt; margin-left:43.75pt; margin-bottom:0pt; text-indent:-36.6pt; font-size:20pt">
				<span style="font-family:Wingdings"></span><span style="width:20.71pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>SELECT<span style="letter-spacing:-0.55pt"> </span>COUNT(*)<span style="letter-spacing:1.75pt"> </span>FROM<span style="letter-spacing:-0.35pt"> </span><span style="letter-spacing:-0.1pt">PRODUCT_MAST;</span>
			</p>
			<p style="margin-top:4.4pt; margin-left:43.75pt; margin-bottom:0pt; text-indent:-36.6pt; font-size:20pt">
				<span style="font-family:Wingdings"></span><span style="width:20.71pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>SELECT<span style="letter-spacing:-0.8pt"> </span>COUNT(*)<span style="letter-spacing:3.7pt"> </span>FROM<span style="letter-spacing:-0.5pt"> </span>PRODUCT_MAST;<span style="letter-spacing:3.7pt"> </span>WHERE<span style="letter-spacing:-0.65pt"> </span><span style="letter-spacing:-0.1pt">RATE&gt;=20;</span>
			</p>
			<p style="margin-top:4.4pt; margin-left:43.75pt; margin-bottom:0pt; text-indent:-36.6pt; font-size:20pt">
				<span style="font-family:Wingdings"></span><span style="width:20.71pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>SELECT<span style="letter-spacing:-1pt"> </span>COUNT(DISTINCT<span style="letter-spacing:-0.95pt"> </span>COMPANY)<span style="letter-spacing:3.2pt"> </span>FROM<span style="letter-spacing:-0.6pt"> </span><span style="letter-spacing:-0.1pt">PRODUCT_MAST</span><span style="letter-spacing:-0.1pt; color:#898989">;</span>
			</p>
			<p style="margin-top:4.35pt; margin-left:43.75pt; margin-bottom:0pt; text-indent:-36.6pt; font-size:20pt">
				<span style="font-family:Wingdings"></span><span style="width:20.71pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>SELECT<span style="letter-spacing:-1.05pt"> </span>COMPANY,<span style="letter-spacing:-1pt"> </span>COUNT(*)<span style="letter-spacing:2.95pt"> </span>FROM<span style="letter-spacing:-0.85pt"> </span>PRODUCT_MAST<span style="letter-spacing:3.05pt"> </span>GROUP<span style="letter-spacing:-0.85pt"> </span>BY<span style="letter-spacing:-0.75pt"> </span><span style="letter-spacing:-0.1pt">COMPANY;</span>
			</p>
			<p style="margin:4.8pt 13.45pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:20pt">
				<span style="font-family:Wingdings"></span><span style="width:20.71pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>SELECT<span style="letter-spacing:-1.15pt"> </span>COMPANY,<span style="letter-spacing:-1.15pt"> </span>COUNT(*)<span style="letter-spacing:2pt"> </span>FROM<span style="letter-spacing:-1pt"> </span>PRODUCT_MAST<span style="letter-spacing:2.8pt"> </span>GROUP<span style="letter-spacing:-0.95pt"> </span>BY<span style="letter-spacing:-0.9pt"> </span>COMPANY HAVING COUNT(*)&gt;2;
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="height:0pt; display:block; position:absolute; z-index:-14"><img src="data:image/png;base64," width="960" height="360" alt="" style="margin-top:240pt; margin-left:-37.15pt; position:absolute" ></span><span style="font-size:40pt; font-weight:normal; color:#ff0000">SUM</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.95pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">FUNCTION</span>
			</h1>
			<p style="margin:12.45pt 87.95pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:28.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>Sum<span style="letter-spacing:-0.6pt"> </span>function<span style="letter-spacing:-0.4pt"> </span>is<span style="letter-spacing:-0.4pt"> </span>used<span style="letter-spacing:-0.4pt"> </span>to<span style="letter-spacing:-0.4pt"> </span>calculate<span style="letter-spacing:-0.55pt"> </span>the<span style="letter-spacing:-0.35pt"> </span>sum<span style="letter-spacing:-0.45pt"> </span>of<span style="letter-spacing:-0.4pt"> </span>all<span style="letter-spacing:-0.4pt"> </span>selected columns. It works on numeric fields only.
			</p>
			<h4 style="margin-top:5.5pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Syntax</span>
			</h4>
			<p style="margin-top:9.05pt; margin-left:83.5pt; margin-bottom:0pt; font-size:20pt">
				<span style="letter-spacing:-0.1pt">SUM()</span><span style="width:13.8pt; display:inline-block">&#xa0;</span><span style="letter-spacing:-0.25pt">or</span><span style="width:13.43pt; display:inline-block">&#xa0;</span>SUM(<span style="letter-spacing:-0.45pt"> </span>[ALL|DISTINCT]<span style="letter-spacing:-0.7pt"> </span>expression<span style="letter-spacing:-0.35pt"> </span><span style="letter-spacing:-0.5pt">)</span>
			</p>
			<h4 style="margin-top:6.35pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Example</span>
			</h4>
			<p style="margin-top:4.4pt; margin-left:43.75pt; margin-bottom:0pt; font-size:20pt">
				SELECT<span style="letter-spacing:-0.55pt"> </span>SUM(COST)<span style="letter-spacing:1.75pt"> </span>FROM<span style="letter-spacing:-0.35pt"> </span><span style="letter-spacing:-0.1pt">PRODUCT_MAST;</span>
			</p>
			<h5 style="margin-top:4.35pt; margin-left:7.15pt; margin-bottom:0pt; font-size:20pt">
				SUM()<span style="letter-spacing:-0.45pt"> </span>with<span style="letter-spacing:-0.3pt"> </span><span style="letter-spacing:-0.2pt">WHERE</span>
			</h5>
			<p style="margin-top:4.4pt; margin-left:43.75pt; margin-bottom:0pt; font-size:20pt">
				SELECT<span style="letter-spacing:-0.65pt"> </span>SUM(COST)<span style="letter-spacing:1.8pt"> </span>FROM<span style="letter-spacing:-0.35pt"> </span>PRODUCT_MAST<span style="letter-spacing:1.85pt"> </span>WHERE<span style="letter-spacing:-0.5pt"> </span><span style="letter-spacing:-0.1pt">QTY&gt;3;</span>
			</p>
			<h5 style="margin-top:4.4pt; margin-left:7.15pt; margin-bottom:0pt; font-size:20pt">
				SUM()<span style="letter-spacing:-0.5pt"> </span>with<span style="letter-spacing:-0.4pt"> </span>GROUP<span style="letter-spacing:-0.4pt"> </span><span style="letter-spacing:-0.25pt">BY</span>
			</h5>
			<p style="margin:4.35pt 138.3pt 0pt 43.75pt; line-height:118%; font-size:20pt">
				SELECT SUM(COST)<span style="width:13.2pt; display:inline-block">&#xa0;</span>FROM PRODUCT_MAST<span style="width:13.34pt; display:inline-block">&#xa0;</span>WHERE<span style="letter-spacing:-1.15pt"> </span>QTY&gt;3 GROUP BY COMPANY;
			</p>
			<h5 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:24.4pt">
				<span style="font-size:20pt">SUM()</span><span style="font-size:20pt; letter-spacing:-0.35pt"> </span><span style="font-size:20pt">with</span><span style="font-size:20pt; letter-spacing:-0.3pt"> </span><span style="font-size:20pt; letter-spacing:-0.1pt">HAVING</span>
			</h5>
			<p style="margin:4.8pt 17.75pt 0pt 43.75pt; line-height:98%; font-size:20pt">
				SELECT<span style="letter-spacing:-1pt"> </span>COMPANY,<span style="letter-spacing:-1pt"> </span>SUM(COST)<span style="letter-spacing:2pt"> </span>FROM<span style="letter-spacing:-0.75pt"> </span>PRODUCT_MAST<span style="letter-spacing:2pt"> </span>GROUP<span style="letter-spacing:-0.8pt"> </span>BY<span style="letter-spacing:-0.75pt"> </span>COM PANY<span style="letter-spacing:2pt"> </span>HAVING SUM(COST)&gt;=170;
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="height:0pt; display:block; position:absolute; z-index:-13"><img src="data:image/png;base64," width="960" height="360" alt="" style="margin-top:240pt; margin-left:-37.15pt; position:absolute" ></span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.45pt; color:#ff0000">AVG</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.8pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">FUNCTION</span>
			</h1>
			<p style="margin:12.45pt 23.7pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:24pt">
				<span style="font-family:Arial">•</span><span style="width:28.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>The AVG function is<span style="letter-spacing:-0.05pt"> </span>used to calculate<span style="letter-spacing:-0.1pt"> </span>the average value of the numeric<span style="letter-spacing:-0.75pt"> </span>type.<span style="letter-spacing:-0.75pt"> </span>AVG<span style="letter-spacing:-0.6pt"> </span>function<span style="letter-spacing:-0.6pt"> </span>returns<span style="letter-spacing:-0.6pt"> </span>the<span style="letter-spacing:-0.65pt"> </span>average<span style="letter-spacing:-0.55pt"> </span>of<span style="letter-spacing:-0.6pt"> </span>all<span style="letter-spacing:-0.6pt"> </span>non-Null <span style="letter-spacing:-0.1pt">values.</span>
			</p>
			<p style="margin-top:10.8pt; margin-bottom:0pt; font-size:24pt">
				&#xa0;
			</p>
			<h4 style="margin-top:0.05pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Syntax</span>
			</h4>
			<p style="margin-top:9.05pt; margin-left:83.5pt; margin-bottom:0pt; font-size:20pt">
				<span style="letter-spacing:-0.1pt">AVG()</span><span style="width:12.68pt; display:inline-block">&#xa0;</span><span style="letter-spacing:-0.25pt">or</span><span style="width:13.43pt; display:inline-block">&#xa0;</span>AVG(<span style="letter-spacing:-1pt"> </span>[ALL|DISTINCT]<span style="letter-spacing:-1.1pt"> </span>expression<span style="letter-spacing:-0.7pt"> </span><span style="letter-spacing:-0.5pt">)</span>
			</p>
			<h4 style="margin-top:6.35pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Example</span>
			</h4>
			<p style="margin-top:4.4pt; margin-left:79.15pt; margin-bottom:0pt; font-size:20pt">
				SELECT<span style="letter-spacing:-0.55pt"> </span><span style="letter-spacing:-0.1pt">AVG(COST)</span><span style="width:11.98pt; display:inline-block">&#xa0;</span>FROM<span style="letter-spacing:-0.4pt"> </span><span style="letter-spacing:-0.1pt">PRODUCT_MAST;</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">MAX</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">FUNCTION</span>
			</h1>
			<p style="margin:12.45pt 32.75pt 0pt 43.75pt; text-indent:-36.6pt; line-height:98%; font-size:20pt">
				<span style="font-family:Arial">•</span><span style="width:29.6pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>MAX<span style="letter-spacing:-0.35pt"> </span>function<span style="letter-spacing:-0.35pt"> </span>is<span style="letter-spacing:-0.15pt"> </span>used<span style="letter-spacing:-0.15pt"> </span>to<span style="letter-spacing:-0.25pt"> </span>find<span style="letter-spacing:-0.15pt"> </span>the<span style="letter-spacing:-0.25pt"> </span>maximum<span style="letter-spacing:-0.1pt"> </span>value<span style="letter-spacing:-0.15pt"> </span>of<span style="letter-spacing:-0.25pt"> </span>a<span style="letter-spacing:-0.15pt"> </span>certain<span style="letter-spacing:-0.15pt"> </span>column.<span style="letter-spacing:-0.4pt"> </span>This function determines the largest value of all selected values of a column.
			</p>
			<h4 style="margin-top:5.45pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Syntax</span>
			</h4>
			<p style="margin-top:9.05pt; margin-left:83.5pt; margin-bottom:0pt; font-size:20pt">
				<span style="letter-spacing:-0.1pt">MAX()</span><span style="width:13.72pt; display:inline-block">&#xa0;</span><span style="letter-spacing:-0.25pt">or</span><span style="width:13.43pt; display:inline-block">&#xa0;</span>MAX(<span style="letter-spacing:-0.65pt"> </span>[ALL|DISTINCT]<span style="letter-spacing:-0.7pt"> </span>expression<span style="letter-spacing:-0.3pt"> </span><span style="letter-spacing:-0.5pt">)</span>
			</p>
			<h4 style="margin-top:6.35pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Example</span>
			</h4>
			<p style="margin-top:4.4pt; margin-left:83.5pt; margin-bottom:0pt; font-size:20pt">
				SELECT<span style="letter-spacing:-0.4pt"> </span><span style="letter-spacing:-0.1pt">MAX(RATE)</span><span style="width:12.06pt; display:inline-block">&#xa0;</span>FROM<span style="letter-spacing:-0.5pt"> </span><span style="letter-spacing:-0.1pt">PRODUCT_MAST;</span>
			</p>
			<h3 style="margin-top:7.1pt; margin-left:7.15pt; margin-bottom:0pt; font-size:32pt">
				<span style="font-weight:normal; color:#ff0000">MIN</span><span style="font-weight:normal; letter-spacing:-0.3pt; color:#ff0000"> </span><span style="font-weight:normal; letter-spacing:-0.1pt; color:#ff0000">FUNCTION</span>
			</h3>
			<p style="margin:4.7pt 36.25pt 0pt 47.35pt; text-indent:-40.2pt; line-height:98%; font-size:20pt">
				<span style="font-family:Arial">•</span><span style="width:33.2pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>MIN<span style="letter-spacing:-0.5pt"> </span>function<span style="letter-spacing:-0.35pt"> </span>is<span style="letter-spacing:-0.05pt"> </span>used<span style="letter-spacing:-0.25pt"> </span>to<span style="letter-spacing:-0.15pt"> </span>find<span style="letter-spacing:-0.25pt"> </span>the<span style="letter-spacing:-0.15pt"> </span>minimum<span style="letter-spacing:-0.2pt"> </span>value<span style="letter-spacing:-0.15pt"> </span>of<span style="letter-spacing:-0.25pt"> </span>a<span style="letter-spacing:-0.15pt"> </span>certain<span style="letter-spacing:-0.15pt"> </span>column.<span style="letter-spacing:-0.4pt"> </span>This function<span style="letter-spacing:-0.45pt"> </span>determines the<span style="letter-spacing:-0.1pt"> </span>smallest value<span style="letter-spacing:-0.2pt"> </span>of<span style="letter-spacing:-0.2pt"> </span>all selected values<span style="letter-spacing:-0.1pt"> </span>of<span style="letter-spacing:-0.2pt"> </span>a<span style="letter-spacing:-0.1pt"> </span>column
			</p>
			<h5 style="margin-top:4.55pt; margin-left:7.15pt; margin-bottom:0pt; font-size:20pt">
				<span style="letter-spacing:-0.1pt">Syntax</span>
			</h5>
			<p style="margin-top:4.4pt; margin-left:48.1pt; margin-bottom:0pt; font-size:20pt">
				<span style="letter-spacing:-0.1pt">MIN()</span><span style="width:13.67pt; display:inline-block">&#xa0;</span><span style="letter-spacing:-0.25pt">or</span><span style="width:13.43pt; display:inline-block">&#xa0;</span>MIN(<span style="letter-spacing:-0.75pt"> </span>[ALL|DISTINCT]<span style="letter-spacing:-0.75pt"> </span>expression<span style="letter-spacing:-0.35pt"> </span><span style="letter-spacing:-0.5pt">)</span>
			</p>
			<h4 style="margin-top:5.25pt; margin-left:7.15pt; margin-bottom:0pt; font-size:24pt">
				<span style="letter-spacing:-0.1pt">Example</span>
			</h4>
			<p style="margin-top:4.4pt; margin-left:83.5pt; margin-bottom:0pt; font-size:20pt">
				SELECT<span style="letter-spacing:-0.4pt"> </span><span style="letter-spacing:-0.1pt">MIN(RATE)</span><span style="width:11.87pt; display:inline-block">&#xa0;</span>FROM<span style="letter-spacing:-0.4pt"> </span><span style="letter-spacing:-0.1pt">PRODUCT_MAST;</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="font-size:40pt; font-weight:normal; color:#ff0000">SQL</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.8pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.2pt; color:#ff0000">JOIN</span>
			</h1>
			<p style="margin-top:12.45pt; margin-left:7.15pt; margin-bottom:0pt; line-height:98%; font-size:20pt">
				SQL,<span style="letter-spacing:-0.25pt"> </span>JOIN<span style="letter-spacing:-0.35pt"> </span>means<span style="letter-spacing:-0.15pt"> </span>"to<span style="letter-spacing:-0.15pt"> </span>combine<span style="letter-spacing:-0.4pt"> </span>two<span style="letter-spacing:-0.15pt"> </span>or<span style="letter-spacing:-0.3pt"> </span>more<span style="letter-spacing:-0.15pt"> </span>tables".<span style="letter-spacing:-0.15pt"> </span>In<span style="letter-spacing:-0.2pt"> </span>SQL,<span style="letter-spacing:-0.15pt"> </span>JOIN<span style="letter-spacing:-0.35pt"> </span>clause<span style="letter-spacing:-0.15pt"> </span>is<span style="letter-spacing:-0.05pt"> </span>used<span style="letter-spacing:-0.25pt"> </span>to combine the records from two or more tables in a database.
