				<span style="color:#ff0000">Types</span><span style="letter-spacing:-1pt; color:#ff0000"> </span><span style="color:#ff0000">of</span><span style="letter-spacing:-0.95pt; color:#ff0000"> </span><span style="color:#ff0000">SQL</span><span style="letter-spacing:-0.8pt; color:#ff0000"> </span><span style="letter-spacing:-0.2pt; color:#ff0000">JOIN</span>
			</p>
			<p style="margin-top:11.4pt; margin-bottom:0pt; font-size:28pt">
				&#xa0;
