				<span style="font-family:Wingdings"></span><span style="width:25.83pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>LEFT<span style="letter-spacing:-0.25pt"> </span><span style="letter-spacing:-0.2pt">JOIN</span>
			</p>
