				&#xa0;
			</p>
			<p style="margin-top:0pt; margin-left:88.65pt; margin-bottom:0pt; text-indent:-44.9pt; font-size:24pt">
				<span style="font-family:Wingdings"></span><span style="width:25.83pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>RIGHT<span style="letter-spacing:-0.4pt"> </span><span style="letter-spacing:-0.2pt">JOIN</span>
			</p>
			<p style="margin-top:10.5pt; margin-bottom:0pt; font-size:24pt">
