			</p>
			<p style="margin-top:0pt; margin-left:88.65pt; margin-bottom:0pt; text-indent:-44.9pt; font-size:24pt">
				<span style="font-family:Wingdings"></span><span style="width:25.83pt; font:7pt 'Times New Roman'; display:inline-block">&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0;&#xa0; </span>FULL<span style="letter-spacing:-0.45pt"> </span><span style="letter-spacing:-0.2pt">JOIN</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="height:0pt; display:block; position:absolute; z-index:-12"><img src="data:image/png;base64," width="960" height="360" alt="" style="margin-top:240pt; margin-left:-37.15pt; position:absolute" ></span><span style="font-size:40pt; font-weight:normal; color:#ff0000">INNER</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.3pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.2pt; color:#ff0000">JOIN</span>
			</h1>
			<p style="margin-top:12.45pt; margin-left:7.15pt; margin-bottom:0pt; line-height:98%; font-size:20pt">
				In SQL, INNER<span style="letter-spacing:-0.1pt"> </span>JOIN selects records that have matching values in both tables as long<span style="letter-spacing:-0.55pt"> </span>as<span style="letter-spacing:-0.25pt"> </span>the<span style="letter-spacing:-0.25pt"> </span>condition<span style="letter-spacing:-0.45pt"> </span>is<span style="letter-spacing:-0.15pt"> </span>satisfied. It<span style="letter-spacing:-0.25pt"> </span>returns<span style="letter-spacing:-0.25pt"> </span>the<span style="letter-spacing:-0.25pt"> </span>combination<span style="letter-spacing:-0.45pt"> </span>of<span style="letter-spacing:-0.35pt"> </span>all<span style="letter-spacing:-0.15pt"> </span>rows<span style="letter-spacing:-0.25pt"> </span>from<span style="letter-spacing:-0.3pt"> </span>both the tables where the condition satisfies.
			</p>
			<h5 style="margin-top:4.65pt; margin-left:7.15pt; margin-bottom:0pt; font-size:20pt">
				<span style="letter-spacing:-0.1pt">Syntax</span>
