			</h1>
			<p style="margin:12.1pt 17.75pt 0pt 7.15pt; line-height:108%; font-size:20pt">
				The<span style="letter-spacing:-0.35pt"> </span>SQL<span style="letter-spacing:-0.4pt"> </span>left<span style="letter-spacing:-0.15pt"> </span>join<span style="letter-spacing:-0.45pt"> </span>returns<span style="letter-spacing:-0.15pt"> </span>all<span style="letter-spacing:-0.3pt"> </span>the<span style="letter-spacing:-0.25pt"> </span>values<span style="letter-spacing:-0.25pt"> </span>from<span style="letter-spacing:-0.3pt"> </span>left<span style="letter-spacing:-0.25pt"> </span>table<span style="letter-spacing:-0.15pt"> </span>and<span style="letter-spacing:-0.45pt"> </span>the<span style="letter-spacing:-0.25pt"> </span>matching<span style="letter-spacing:-0.3pt"> </span>values from the right table. If there is no matching join value, it will return NULL. <strong><span style="letter-spacing:-0.1pt">Syntax</span></strong>
