				<span style="font-size:20pt">LEFT</span><span style="font-size:20pt; letter-spacing:-0.35pt"> </span><span style="font-size:20pt">JOIN</span><span style="font-size:20pt; letter-spacing:-0.25pt"> </span><span style="font-size:20pt; letter-spacing:-0.1pt">table2</span>
			</p>
