				ON<span style="letter-spacing:-0.9pt"> </span>table1.matching_column<span style="letter-spacing:-0.55pt"> </span>=<span style="letter-spacing:-0.45pt"> </span><span style="letter-spacing:-0.1pt">table2.matching_column;</span>
			</p>
