				<span style="letter-spacing:-0.1pt">Example</span>
			</h5>
			<p style="margin:4.35pt 138.3pt 0pt 43.75pt; line-height:118%; font-size:20pt">
				<span style="letter-spacing:-0.1pt">SELECT</span><span style="letter-spacing:-1.05pt"> </span><span style="letter-spacing:-0.1pt">EMPLOYEE.EMP_NAME,</span><span style="letter-spacing:-1.05pt"> </span><span style="letter-spacing:-0.1pt">PROJECT.DEPARTMENT </span>FROM EMPLOYEE
			</p>
			<p style="margin-top:0pt; margin-left:43.75pt; margin-bottom:0pt; line-height:24.4pt">
				<span style="font-size:20pt">LEFT</span><span style="font-size:20pt; letter-spacing:-0.35pt"> </span><span style="font-size:20pt">JOIN</span><span style="font-size:20pt; letter-spacing:-0.25pt"> </span><span style="font-size:20pt; letter-spacing:-0.1pt">PROJECT</span>
			</p>
			<p style="margin-top:4.4pt; margin-left:43.75pt; margin-bottom:0pt; font-size:20pt">
				<span style="letter-spacing:-0.1pt">ON</span><span style="letter-spacing:-0.8pt"> </span><span style="letter-spacing:-0.1pt">PROJECT.EMP_ID</span><span style="letter-spacing:-0.75pt"> </span><span style="letter-spacing:-0.1pt">=</span><span style="letter-spacing:-0.4pt"> </span><span style="letter-spacing:-0.1pt">EMPLOYEE.EMP_ID;</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; text-align:justify; line-height:45.2pt">
				<span style="height:0pt; text-align:left; display:block; position:absolute; z-index:-10"><img src="data:image/png;base64," width="960" height="360" alt="" style="margin-top:240pt; margin-left:-37.15pt; position:absolute" ></span><span style="font-size:40pt; font-weight:normal; color:#ff0000">RIGHT</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-1.2pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.2pt; color:#ff0000">JOIN</span>
			</h1>
			<p style="margin:12.45pt 21.15pt 0pt 7.15pt; text-align:justify; line-height:98%; font-size:20pt">
				In<span style="letter-spacing:-0.15pt"> </span>SQL, RIGHT<span style="letter-spacing:-0.1pt"> </span>JOIN<span style="letter-spacing:-0.15pt"> </span>returns all the values from the values from the<span style="letter-spacing:-0.05pt"> </span>rows of<span style="letter-spacing:-0.05pt"> </span>right table<span style="letter-spacing:-0.35pt"> </span>and<span style="letter-spacing:-0.35pt"> </span>the<span style="letter-spacing:-0.25pt"> </span>matched<span style="letter-spacing:-0.35pt"> </span>values<span style="letter-spacing:-0.15pt"> </span>from<span style="letter-spacing:-0.3pt"> </span>the<span style="letter-spacing:-0.35pt"> </span>left<span style="letter-spacing:-0.15pt"> </span>table.<span style="letter-spacing:-0.25pt"> </span>If<span style="letter-spacing:-0.35pt"> </span>there<span style="letter-spacing:-0.25pt"> </span>is<span style="letter-spacing:-0.25pt"> </span>no<span style="letter-spacing:-0.35pt"> </span>matching<span style="letter-spacing:-0.3pt"> </span>in<span style="letter-spacing:-0.25pt"> </span>both tables, it will return NULL.
