			</p>
			<p style="margin-top:0pt; margin-left:43.75pt; margin-bottom:0pt; line-height:24.4pt">
				<span style="font-size:20pt">RIGHT</span><span style="font-size:20pt; letter-spacing:-0.35pt"> </span><span style="font-size:20pt">JOIN</span><span style="font-size:20pt; letter-spacing:-0.35pt"> </span><span style="font-size:20pt; letter-spacing:-0.1pt">PROJECT</span>
			</p>
			<p style="margin-top:4.35pt; margin-left:43.75pt; margin-bottom:0pt; font-size:20pt">
				<span style="letter-spacing:-0.1pt">ON</span><span style="letter-spacing:-0.8pt"> </span><span style="letter-spacing:-0.1pt">PROJECT.EMP_ID</span><span style="letter-spacing:-0.75pt"> </span><span style="letter-spacing:-0.1pt">=</span><span style="letter-spacing:-0.4pt"> </span><span style="letter-spacing:-0.1pt">EMPLOYEE.EMP_ID;</span>
			</p>
		</div>
		<br style="page-break-before:always; clear:both; mso-break-type:section-break" >
		<div>
			<h1 style="margin-top:0pt; margin-left:7.15pt; margin-bottom:0pt; line-height:45.2pt">
				<span style="height:0pt; display:block; position:absolute; z-index:-9"><img src="data:image/png;base64," width="960" height="360" alt="" style="margin-top:240pt; margin-left:-37.15pt; position:absolute" ></span><span style="font-size:40pt; font-weight:normal; color:#ff0000">FULL</span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.95pt; color:#ff0000"> </span><span style="font-size:40pt; font-weight:normal; letter-spacing:-0.2pt; color:#ff0000">JOIN</span>
			</h1>
			<p style="margin-top:12.45pt; margin-left:7.15pt; margin-bottom:0pt; line-height:98%; font-size:20pt">
				In<span style="letter-spacing:-0.35pt"> </span>SQL,<span style="letter-spacing:-0.15pt"> </span>FULL<span style="letter-spacing:-0.3pt"> </span>JOIN<span style="letter-spacing:-0.35pt"> </span>is<span style="letter-spacing:-0.05pt"> </span>the<span style="letter-spacing:-0.25pt"> </span>result<span style="letter-spacing:-0.05pt"> </span>of<span style="letter-spacing:-0.25pt"> </span>a<span style="letter-spacing:-0.15pt"> </span>combination<span style="letter-spacing:-0.25pt"> </span>of<span style="letter-spacing:-0.25pt"> </span>both<span style="letter-spacing:-0.35pt"> </span>left<span style="letter-spacing:-0.15pt"> </span>and<span style="letter-spacing:-0.25pt"> </span>right<span style="letter-spacing:-0.15pt"> </span>outer<span style="letter-spacing:-0.3pt"> </span>join. Join tables have all the records from both tables. It puts NULL on the place of matches not found.
